INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (1, 60000, 1, 0, 0, 1, 190804, "カリン", "新年を迎え、新たに始まる一日を\nおみくじで占ってみませんか？\n良い運勢であるほど、\n沢山のプレゼントが貰えますよ♪", 1, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (2, 60000, 2, 0, 1, 1, 0, "", "今日の運勢は姫吉！　あらゆる運気が最大を示しています！　　　今なら「伝説の吸血鬼」をも従え、世界征服も夢じゃありません！", 0, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (3, 60000, 2, 0, 1, 1, 0, "", "今日の運勢は姫吉！　やること全てが最高潮！　やばいですね☆　ラッキーアイテムはおにぎり！　お腹一杯で幸せが続くでしょう！", 0, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (4, 60000, 2, 0, 1, 2, 0, "", "今日の運勢は姫吉！　その高い運気はまさにショーグンの如く！　その溢れる威光は人々を惹きつけ、皆の人気者間違いなしです！", 0, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (5, 60000, 2, 0, 2, 1, 0, "", "今日の運勢は大吉！　運気がどんどん高まっています！　　　　　何をやっても、最大効率で素晴らしい結果になりますよ♪", 0, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (6, 60000, 2, 0, 2, 1, 0, "", "今日の運勢は大吉！　なにをやっても上手くいって大活躍！　　　そんな素敵なあなたを見て、後ろから誰かが……クスクス♪", 0, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (7, 60000, 2, 0, 2, 2, 0, "", "今日の運勢は大吉！　運気が高く、何かに挑戦すると良い結果に！隠れた才能が引き出されそう！　目指せヒデサ……ではなく秀才！", 0, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (8, 60000, 2, 0, 3, 1, 0, "", "今日の運勢は中吉！　商売運が上がってきています！　　　　　　ラッキーアイテムはたいやき！　和菓子パワーで売上アップです！", 0, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (9, 60000, 2, 0, 3, 1, 0, "", "今日の運勢は中吉！　旅行運がぐんぐんと上昇中♪　　　　　　　もしかしたら、あの「マホマホ王国」にだって行けるかも♪", 0, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (10, 60000, 2, 0, 3, 1, 0, "", "今日の運勢は中吉！　仕事運が急上昇中です！　　　　　　　　　きっと「煉獄に舞う一陣の疾風」の如き活躍ができますよ！", 0, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (11, 60000, 2, 0, 3, 1, 0, "", "今日の運勢は中吉！　チャンスを待つと良い結果に！　　　　　　ラッキーアイテムのプリンを食べて、運を呼び込みましょう！", 0, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (12, 60000, 2, 0, 3, 2, 0, "", "今日の運勢は中吉！　運気が着々と上昇中！　　　　　　　　　　精霊の加護を受けたかの如く、色々な事がうまくいきますよ♪", 0, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (13, 60000, 2, 0, 4, 1, 0, "", "今日の運勢は小吉！　早朝に幸運の兆しあり！　　　　　　　　　もしかしたら、優しいお姉ちゃんが起こしにきてくれますよ♪", 0, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (14, 60000, 2, 0, 4, 1, 0, "", "今日の運勢は小吉！　運気上昇中ですが、上がるまでが要注意！　ラッキーアニマルは熊！　本当の家族のように守ってくれるかも♪", 0, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (15, 60000, 2, 0, 4, 1, 0, "", "今日の運勢は小吉！　外に出てゆっくり過ごすと運気が上昇！　　ラッキースポットは牧場。面白い出会いがありそうです♪", 0, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (16, 60000, 2, 0, 4, 1, 0, "", "今日の運勢は小吉！　運気は高いけども、ハプニングには注意！　出かけた先で、「ふしんしゃ」扱いされてしまうかも……", 0, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (17, 60000, 2, 0, 4, 2, 0, "", "今日の運勢は小吉！　根を詰めずにリラックスすると運気向上！　ラッキーパーソンはアイドル。歌があなたを幸せにしてくれます♪", 0, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (18, 60000, 3, 0, 0, 0, 190804, "カリン", "おみくじの結果はどうでしたか？\n新たに始まる一日が、あなたに\nとって良い日になりますように\nまた明日も遊びに来て下さいね♪", 2, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (19, 60000, 3, 7, 0, 0, 190804, "カリン", "おみくじは楽しんで頂けましたか？\nあなたの新たなる年が\n素晴らしいものになるよう、\n心からお祈りいたします", 3, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (20, 80001, 0, 1, 0, 0, 101201, "ハツネ", "キミと出会ってもう\n1年もたつんだね！\nう～ん、いつも\n寝てばっかりだから、", 1, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (21, 80001, 0, 1, 0, 0, 101201, "ハツネ", "少しでも\n寝る時間を減らして\nキミと一緒にいる\n時間増やしたいなぁ♪", 2, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (22, 80001, 1, 1, 0, 0, 103801, "シオリ", "あなたと知り合ってから\nもう1年…\n時がたつのは\n早いですね", 1, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (23, 80001, 1, 1, 0, 0, 103801, "シオリ", "来年も、\n一緒にいられたら…\nうれしいな", 2, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (24, 80001, 0, 2, 0, 0, 103601, "キョウカ", "あなたと一緒にいるようになって、\nもう1年ですか…", 1, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (25, 80001, 0, 2, 0, 0, 103601, "キョウカ", "最初の頃よりも、頼もしく\nなりましたね。私はどうですか？\n成長していますか？", 2, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (26, 80001, 1, 2, 0, 0, 102001, "ミミ", "おにいちゃんとあってから、\n1年たったよ～！", 1, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (27, 80001, 1, 2, 0, 0, 102001, "ミミ", "ミミね、おにいちゃんと\nいっぱい遊べてたのしかったな～♪\nこれからもずっと\nいっしょにいてね～！", 2, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (28, 80001, 2, 2, 0, 0, 100401, "ミソギ", "にいちゃんがミソギのイタズラに\n引っかかり続けてもう1年かぁ", 1, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (29, 80001, 2, 2, 0, 0, 100401, "ミソギ", "…これからもいっぱいミソギと\n遊んでね、にいちゃん！", 2, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (30, 80001, 0, 3, 0, 0, 101001, "マホ", "もう王子はんと会うてから\n1年ぐらいたつそうどすえ\n早いもんやなあ", 1, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (31, 80001, 0, 3, 0, 0, 101001, "マホ", "このままやと、\nうちもあっという間に\n干からびてしまいそうどすえ\nなーんてな。うふふ", 2, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (32, 80001, 1, 3, 0, 0, 104401, "イリヤ", "お主と会って早1年じゃな\nこれからも存分に尽くすがよい", 1, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (33, 80001, 1, 3, 0, 0, 104401, "イリヤ", "わらわもたまには、お主の献身に\n報いてやらぬでもない♪", 2, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (34, 80001, 2, 3, 0, 0, 101701, "カオリ", "もう、キミと出会って結構な時間が\nたつさ～。でも、私たちの旅は\nまだまだ始まったばかりさ～！", 1, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (35, 80001, 2, 3, 0, 0, 101701, "カオリ", "これからも、どうぞよろしく\nお願いするさ～！", 2, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (36, 80001, 0, 4, 0, 0, 102801, "サレン", "あんたと出会ってからもうそんなに\nたつのね～", 1, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (37, 80001, 0, 4, 0, 0, 102801, "サレン", "あっという間だったって感じるほど\n楽しかったわ！\nこれからも一緒に頑張りましょ！", 2, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (38, 80001, 1, 4, 0, 0, 102501, "スズメ", "出会ってから1年間、ずっと\nご迷惑をかけっぱなしで、\nすみません…", 1, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (39, 80001, 1, 4, 0, 0, 102501, "スズメ", "これからはもっと頑張りますから\n見ていてくださいね\nできれば…\n今までよりも、私の近くで♪", 2, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (40, 80001, 0, 5, 0, 0, 104601, "タマキ", "振り返れば、今までいろんなことが\nあったにゃあ…", 1, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (41, 80001, 0, 5, 0, 0, 104601, "タマキ", "これからも、二人でたくさんの\n思い出をがっぽり作っていく\nにゃー！", 2, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (42, 80001, 1, 5, 0, 0, 104801, "ミフユ", "キミとの師弟関係も、\nもう1年なのね…\nでもキミに教えることは、", 1, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (43, 80001, 1, 5, 0, 0, 104801, "ミフユ", "まだまだいっぱいあるわ\nこれからも、\nしっかりついて来てね！", 2, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (44, 80001, 0, 6, 0, 0, 103201, "アキノ", "あなたさまと出会ってもう1年…", 1, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (45, 80001, 0, 6, 0, 0, 103201, "アキノ", "光陰矢のごとし、とはまさに\nこのことですわ。…思い出は決して\nお金では買えませんわね", 2, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (46, 80001, 1, 6, 0, 0, 103401, "ユカリ", "ダメな私を1年間も見捨てないで\nくれて、本当にありがとう", 1, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (47, 80001, 1, 6, 0, 0, 103401, "ユカリ", "情けないところいっぱいみせるかも\nしれないけど、これからも一緒に\nいてくれると、うれしいな", 2, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (48, 80001, 0, 7, 0, 0, 107101, "クリスティーナ", "オマエと出会ってもう1年か\nまさかこのワタシの結婚相手に\nなろうとはな…", 1, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (49, 80001, 0, 7, 0, 0, 107101, "クリスティーナ", "ともかくこれからも\n愉しませてくれよ☆", 2, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (50, 80001, 1, 7, 0, 0, 104701, "ジュン", "君と出会ってからもう1年か。\n以前と比べて私の表情もいくらか\n柔らかくなった気がするんだが、\nどうだろう？", 1, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (51, 80001, 1, 7, 0, 0, 104701, "ジュン", "見えないから分からないって？\nそれもそうだな…", 2, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (52, 80001, 0, 8, 0, 0, 103701, "トモ", "もう1年たったみたいだね\nあなたをからかってばかりだった\nけど、楽しかった♪", 1, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (53, 80001, 0, 8, 0, 0, 103701, "トモ", "これからもよろしくね！", 2, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (54, 80001, 1, 8, 0, 0, 100501, "マツリ", "出会って、もう1年たっちゃった\nんスね。なんだか意外ッス", 1, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (55, 80001, 1, 8, 0, 0, 100501, "マツリ", "毎日楽しくて、あっという間に過ぎ\nちゃったみたいなんスよね\nこれからも一緒に悪と戦うッス！", 2, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (56, 80001, 0, 9, 0, 0, 100701, "ミヤコ", "オマエと会って1年なの！\n全然成仏もできなかったし、", 1, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (57, 80001, 0, 9, 0, 0, 100701, "ミヤコ", "生き返りもしなかったけど、\nすごく楽しかったの～♪\nオマエとプリンがあれば、\nミヤコはハッピーなの～♪", 2, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (58, 80001, 1, 9, 0, 0, 103101, "シノブ", "あなたと出会って1年なんですね\nでも、私の占いでは、私とあなたは", 1, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (59, 80001, 1, 9, 0, 0, 103101, "シノブ", "来年も再来年も一緒にいるようです\nふふ、よろしくお願いしますね", 2, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (60, 80001, 0, 10, 0, 0, 100901, "アンナ", "貴様が閃光のシグルドとして覚醒し\nもう1年か…。これからも我らの\n長き戦いに終わりはないが、", 1, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (61, 80001, 0, 10, 0, 0, 100901, "アンナ", "それでも貴様となら…\n添い遂げる覚悟はできているぞ！", 2, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (62, 80001, 1, 10, 0, 0, 101301, "ナナカ", "君と出会ってもう1年だって！\n早いねー！", 1, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (63, 80001, 1, 10, 0, 0, 101301, "ナナカ", "これからも最強のバディタッグで\n大活躍だー！\n頼りにしてるよ、相棒！", 2, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (64, 80001, 0, 11, 0, 0, 105101, "ミツキ", "1年たつのって、あっという間ね\nまだまだ君の知らない部分が\nたくさんあるし…", 1, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (65, 80001, 0, 11, 0, 0, 105101, "ミツキ", "これからも、いろんなところを\n調べさせてね？", 2, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (66, 80001, 1, 11, 0, 0, 105601, "ルカ", "お前さんと出会ってもう1年か\n助太刀するつもりが", 1, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (67, 80001, 1, 11, 0, 0, 105601, "ルカ", "逆に助けられたりもしたね\nこれからもよろしく頼むよ！", 2, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (68, 80001, 2, 11, 0, 0, 102701, "エリコ", "早いものですわね、あなた様と\nお会いして、もう1年…", 1, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (69, 80001, 2, 11, 0, 0, 102701, "エリコ", "あなた様といると、時があっと\nいう間に過ぎてしまいます\n時間を止める研究をしなくては\nいけませんね…", 2, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (70, 80001, 0, 12, 0, 0, 102301, "アヤネ", "お兄ちゃんと会ってから、もう、\n1年なんだね。私、少しは\nお姉ちゃんっぽくなったかな？", 1, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (71, 80001, 0, 12, 0, 0, 102301, "アヤネ", "あ、ぷうきちもお兄ちゃんっぽく\nなったよね？", 2, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (72, 80001, 1, 12, 0, 0, 104201, "チカ", "あなたと出会って、\nもう1年がたったんですね…\nこれからもそばにいて、", 1, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (73, 80001, 1, 12, 0, 0, 104201, "チカ", "私のことを見守ってください\nできることなら、ずっと…", 2, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (74, 80001, 2, 12, 0, 0, 102101, "クルミ", "お兄ちゃんと出会って1年かぁ\n私、相変わらずダメダメで…", 1, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (75, 80001, 2, 12, 0, 0, 102101, "クルミ", "で、でもこれからもずっと…\n一緒にいたいなぁ…", 2, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (76, 80001, 0, 13, 0, 0, 104901, "シズル", "再会してちょうど1年だね\nお祝いにごちそう作ってきたよ～♪\n特製ケーキと、お寿司と、", 1, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (77, 80001, 0, 13, 0, 0, 104901, "シズル", "ハンバーグと、カレーと、\nシチューと、あ、隠しきれない隠し\n味は、お姉ちゃんの愛情だよ！", 2, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (78, 80001, 1, 13, 0, 0, 101101, "リノ", "お兄ちゃんと再会して、もう1年\nなんですね。\n会えなかった時を思うと、", 1, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (79, 80001, 1, 13, 0, 0, 101101, "リノ", "信じられないくらい幸せな1年\nでした！もう絶対、私から離れ\nないでくださいね♪", 2, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (80, 80001, 0, 14, 0, 0, 100201, "ユイ", "騎士クンと出会ってから今まで、\nいろんなことがあったよね\n楽しいこと、ドキドキしたこと…", 1, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (81, 80001, 0, 14, 0, 0, 100201, "ユイ", "そんな日々をこれからも、\nず、ずっと一緒に…\n過ごしていきたいな…！", 2, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (82, 80001, 1, 14, 0, 0, 100101, "ヒヨリ", "騎士くんと出会って、まだ1年しか\nたってないんだ！？", 1, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (83, 80001, 1, 14, 0, 0, 100101, "ヒヨリ", "なんかもうずっと一緒にいる気が\nするなぁ…えへへ。これからの\n1年もまたよろしくねっ！\n騎士くん！", 2, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (84, 80001, 2, 14, 0, 0, 100301, "レイ", "初めてキミに出会って1年…\n随分見違えたね私もキミも、\n更に強くなっていく…", 1, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (85, 80001, 2, 14, 0, 0, 100301, "レイ", "キミに背中を預けられる日が、\n早くきますように", 2, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (86, 80001, 0, 15, 0, 0, 105801, "ペコリーヌ", "1年もわたしのことを、忘れない\nでいてくれて、ありがとうござい\nます！", 1, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (87, 80001, 0, 15, 0, 0, 105801, "ペコリーヌ", "これからもずっと、覚えていて\nくださいね！", 2, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (88, 80001, 1, 15, 0, 0, 105901, "コッコロ", "こうして1年も、主さまのおそばに\n置いていただけて、とても光栄\nです。どうかこれからも、", 1, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (89, 80001, 1, 15, 0, 0, 105901, "コッコロ", "末永く主さまをお世話させて\nください。わたくしは、ずっと\n主さまのガイド役でいたいのです", 2, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (90, 80001, 2, 15, 0, 0, 106001, "キャル", "1年か、まっさかこんなに長い\n付き合いになるなんてね～\nでも…わりと楽しい1年だったかも", 1, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (91, 80001, 2, 15, 0, 0, 106001, "キャル", "だから、もうしばらくあんたに\n付き合ってやるわよ喜びなさい！", 2, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (92, 60001, 1, 0, 0, 1, 112101, "スズメ", "新しい年のはじめに、\nおみくじはいかがでしょうか？\nよい運勢であるほど、\n沢山プレゼントが貰えますよ♪", 1, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (93, 60001, 2, 0, 1, 1, 0, "", "今日の運勢は姫吉！　あらゆる運気が最大を示しています！　　　今なら「伝説の吸血鬼」をも従え、世界征服も夢じゃありません！", 0, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (94, 60001, 2, 0, 1, 1, 0, "", "今日の運勢は姫吉！　やること全てが最高潮！　やばいですね☆　ラッキーアイテムはおにぎり！　お腹一杯で幸せが続くでしょう！", 0, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (95, 60001, 2, 0, 1, 1, 0, "", "今日の運勢は姫吉！　最強の運勢でどんなドジも跳ね除けます！　大切な人と一緒に、最高の一日になること間違いなし！", 0, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (96, 60001, 2, 0, 1, 1, 0, "", "今日の運勢は姫吉！　どんな挑戦も上手くいく、最高の運勢です！理想の自分に変身できる絶好の機会！　新しい一歩を踏み出そう！", 0, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (97, 60001, 2, 0, 1, 2, 0, "", "今日の運勢は姫吉！　その高い運気はまさにショーグンの如く！　その溢れる威光は人々を惹きつけ、皆の人気者間違いなしです！", 0, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (98, 60001, 2, 0, 2, 1, 0, "", "今日の運勢は大吉！　運気がどんどん高まっています！　　　　　何をやっても、最大効率で素晴らしい結果になりますよ♪", 0, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (99, 60001, 2, 0, 2, 1, 0, "", "今日の運勢は大吉！　なにをやっても上手くいって大活躍！　　　そんな素敵なあなたを見て、後ろから誰かが……クスクス♪", 0, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (100, 60001, 2, 0, 2, 1, 0, "", "今日の運勢は大吉！　ラッキーワードは「ちぇる～ん♪」　　　　出会う人みんなに言ってあげると、ハッピーになれますよ！", 0, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (101, 60001, 2, 0, 2, 1, 0, "", "今日の運勢は大吉！　運勢はバッチリで無敵状態！　　　　　　　龍眼で全てを見通して、思い通りの一日を過ごしましょう！", 0, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (102, 60001, 2, 0, 2, 2, 0, "", "今日の運勢は大吉！　運気が高く、何かに挑戦すると良い結果に！隠れた才能が引き出されそう！　目指せヒデサ……ではなく秀才！", 0, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (103, 60001, 2, 0, 3, 1, 0, "", "今日の運勢は中吉！　商売運が上がってきています！　　　　　　ラッキーアイテムはたいやき！　和菓子パワーで売上アップです！", 0, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (104, 60001, 2, 0, 3, 1, 0, "", "今日の運勢は中吉！　旅行運がぐんぐんと上昇中♪　　　　　　　もしかしたら、あの「マホマホ王国」にだって行けるかも♪", 0, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (105, 60001, 2, 0, 3, 1, 0, "", "今日の運勢は中吉！　仕事運が急上昇中です！　　　　　　　　　きっと「煉獄に舞う一陣の疾風」の如き活躍ができますよ！", 0, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (106, 60001, 2, 0, 3, 1, 0, "", "今日の運勢は中吉！　チャンスを待つと良い結果に！　　　　　　ラッキーアイテムのプリンを食べて、運を呼び込みましょう！", 0, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (107, 60001, 2, 0, 3, 1, 0, "", "今日の運勢は中吉！　お出かけした先で良縁に恵まれそうです！　ダウナー系あざとい女子が、あま～い飴をくれるかも？", 0, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (108, 60001, 2, 0, 3, 1, 0, "", "今日の運勢は中吉！　大抵のことはゴリ押しでなんとかできます！ラッキープレイスはゲーセン。パンチングマシンでストレス発散！", 0, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (109, 60001, 2, 0, 3, 2, 0, "", "今日の運勢は中吉！　運気が着々と上昇中！　　　　　　　　　　精霊の加護を受けたかの如く、色々な事がうまくいきますよ♪", 0, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (110, 60001, 2, 0, 4, 1, 0, "", "今日の運勢は小吉！　早朝に幸運の兆しあり！　　　　　　　　　もしかしたら、優しいお姉ちゃんが起こしにきてくれますよ♪", 0, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (111, 60001, 2, 0, 4, 1, 0, "", "今日の運勢は小吉！　運気上昇中ですが、上がるまでが要注意！　ラッキーアニマルは熊！　本当の家族のように守ってくれるかも♪", 0, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (112, 60001, 2, 0, 4, 1, 0, "", "今日の運勢は小吉！　外に出てゆっくり過ごすと運気が上昇！　　ラッキースポットは牧場。面白い出会いがありそうです♪", 0, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (113, 60001, 2, 0, 4, 1, 0, "", "今日の運勢は小吉！　運気は高いけども、ハプニングには注意！　出かけた先で、「ふしんしゃ」扱いされてしまうかも……", 0, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (114, 60001, 2, 0, 4, 1, 0, "", "今日の運勢は小吉！　同腹一心の友だちが見つかるかも！　　　　キーワードは「ユニちゃんズ」、記憶に刻みましょう！", 0, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (115, 60001, 2, 0, 4, 1, 0, "", "今日の運勢は小吉！　思わぬ相手と仲良くなれるかも？　　　　　うっかり毒舌をもらしてしまわないように要注意です！", 0, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (116, 60001, 2, 0, 4, 2, 0, "", "今日の運勢は小吉！　根を詰めずにリラックスすると運気向上！　ラッキーパーソンはアイドル。歌があなたを幸せにしてくれます♪", 0, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (117, 60001, 3, 0, 0, 0, 112101, "スズメ", "おみくじの結果はいかがでしたか？\n新たに始まる一日が、\nあなたにとってよい日になりますように\n明日もお待ちしていますね♪", 2, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (118, 60001, 3, 7, 0, 0, 112101, "スズメ", "おみくじ、楽しんで頂けましたか？\nあなたの新しい年が\n素晴らしいものになるよう、\n心からお祈りしますね", 3, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (119, 80003, 0, 1, 0, 0, 105801, "ペコリーヌ", "ヒューヒュー♪\nドンドンパフパフー♪", 1, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (120, 80003, 1, 1, 0, 0, 105901, "コッコロ", "ひゅーひゅー\nどんどんぱふぱふー\nでございます", 1, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (121, 80003, 1, 1, 0, 0, 105901, "コッコロ", "さぁ、キャルさまもご一緒に\nどんどんぱふぱふいたしましょう", 2, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (122, 80003, 2, 1, 0, 0, 106001, "キャル", "え？　ちょっと\nいきなりなにっ？", 1, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (123, 80003, 2, 1, 0, 0, 106001, "キャル", "ドンドンパフパフってなんなの？\nあたしにも分かるように\nちゃんと説明しなさいっての！", 2, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (124, 80003, 0, 1, 0, 0, 105801, "ペコリーヌ", "実はですねキャルちゃん！\nもうすぐわたしたちにとっての\n大切な節目──", 2, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (125, 80003, 0, 1, 0, 0, 105801, "ペコリーヌ", "『プリンセスコネクト！\nRe:Dive』\n2.5周年なんですよ！\nやばいですね☆", 3, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (126, 80003, 1, 1, 0, 0, 105901, "コッコロ", "ですからその日に向けて\n今から気分を盛り上げているのです", 3, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (127, 80003, 2, 1, 0, 0, 106001, "キャル", "ああ、そういえば\nそんな時期だっけ\nって言っても、もう少し先じゃない\n気が早いんじゃないの？", 3, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (128, 80003, 1, 1, 0, 0, 105901, "コッコロ", "いいえ、キャルさま\nこういったお祝いは準備から\n楽しむものでございます\nそうですよね、ペコリーヌさま", 4, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (129, 80003, 0, 1, 0, 0, 105801, "ペコリーヌ", "その通りです♪　というわけで！\nカウントダウンの始まりですよ！\nみんなで一緒に2.5周年に向けて\n盛り上がっていきましょー☆", 4, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (130, 80003, 2, 1, 0, 0, 106001, "キャル", "ド、ドンドンパフパフ～\nって何言わせんのよ！\nまったくもう、浮かれちゃってさ", 4, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (131, 80003, 1, 1, 0, 0, 105901, "コッコロ", "ふふ。キャルさまもワクワクして\nおいでのようですね\nそれでは主さま。大切な記念日まで\nどうぞご期待くださいませ", 5, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (132, 80003, 0, 2, 0, 0, 106001, "キャル", "記念日を盛り上げるったって\n一体どうしたらいいのよ？\nあたし、そういうの\n苦手なんだけど…", 5, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (133, 80003, 1, 2, 0, 0, 190801, "カリン", "あら、キャルさん\nどうかなさいましたか？\n何かお困りのようですけど", 1, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (134, 80003, 0, 2, 0, 0, 106001, "キャル", "げっ…カリンじゃない\nなんでもないわよ！", 6, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (135, 80003, 1, 2, 0, 0, 190801, "カリン", "そうなのですか？\nキャルさんのことですからてっきり\n2.5周年をどう盛り上げたら\nいいか悩んでいるのかと…", 2, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (136, 80003, 0, 2, 0, 0, 106001, "キャル", "分かってんじゃないのよ！？\nいっ、いや、違うけどね！\nあたしは別にそんなことで\n悩んでないわよっ？", 7, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (137, 80003, 1, 2, 0, 0, 190801, "カリン", "ふふっ…\nこういう時は、真心を込めて\n気持ちをそのまま口にしたら\nいいのではないでしょうか？", 3, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (138, 80003, 0, 2, 0, 0, 106001, "キャル", "気持ちを、ねぇ\nそれが一番難しいんじゃない…\nそもそも、あたしは記念日とか\n別にどうだっていいし", 8, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (139, 80003, 0, 2, 0, 0, 106001, "キャル", "…まあ、ペコリーヌもコロ助も\nやけに楽しそうだったから…\nこういうお祭り騒ぎみたいなのも\nたまにはいいかな、とは思うけど", 9, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (140, 80003, 1, 2, 0, 0, 190801, "カリン", "なるほどなるほど～\nキャルさんは【美食殿】で祝う\n2.5周年を心から楽しみに\nしている、ということですね！", 4, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (141, 80003, 0, 2, 0, 0, 106001, "キャル", "はぁ！？\nどこ聞いたらそうなるのよ！\nあたしは別に楽しみになんか…！", 10, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (142, 80003, 1, 2, 0, 0, 190801, "カリン", "キャルさんの心からの想い\nみなさんにも伝わったでしょうか？\n私も2.5周年が楽しみです！\n以上、カリンがお伝えしました！", 5, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (143, 80003, 0, 2, 0, 0, 106001, "キャル", "心からの想いって何なのよ！？\n勝手に人の言葉を\n捻じ曲げんじゃないわよ！\nこのくそ眼鏡ーーーっ！", 11, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (144, 80003, 0, 3, 0, 0, 105901, "コッコロ", "ペコリーヌさま、もうすぐ\n記念日でございますね\nこういった節目というのは\n感慨深いものでございます", 6, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (145, 80003, 1, 3, 0, 0, 105801, "ペコリーヌ", "色んな思い出が蘇ってきますね！\n楽しい出来事が\nいっぱいありました♪", 5, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (146, 80003, 0, 3, 0, 0, 105901, "コッコロ", "はい、そうでございますね\n主さまも【美食殿】の活動の他にも\nいろんなご経験をされたと\n聞いておりますよ", 7, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (147, 80003, 0, 3, 0, 0, 105901, "コッコロ", "たしか…ランドソルで話題沸騰と\nなっていた、魔法少女なるものに\nお会いになられたとか", 8, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (148, 80003, 1, 3, 0, 0, 105801, "ペコリーヌ", "魔法少女って、あの美味しくって\n栄養たっぷりの大ヒット商品\n『魔法少女ソーセージ』の箱に\n描いてある女の子のことですか！？", 6, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (149, 80003, 1, 3, 0, 0, 105801, "ペコリーヌ", "あのソーセージ\n美味しいんですよね～♪\nわたしもたっくさん食べてますよ！", 7, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (150, 80003, 0, 3, 0, 0, 105901, "コッコロ", "あとは、牧場に素敵な温泉が\n出来たとか…", 9, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (151, 80003, 1, 3, 0, 0, 105801, "ペコリーヌ", "牧場ですか！？　温泉につかって\nチーズもオツですね～♪　考えた\nだけでよだれが出ちゃいそうです！\nやばいですね☆", 8, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (152, 80003, 0, 3, 0, 0, 105901, "コッコロ", "ペコリーヌさま\n言ってるそばからよだれが…\n今お拭きしますね。ふき、ふき", 10, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (153, 80003, 1, 3, 0, 0, 105801, "ペコリーヌ", "えへへ、ありがとうございます\nコッコロちゃん！", 9, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (154, 80003, 0, 3, 0, 0, 105901, "コッコロ", "それにしても、主さまは\n【美食殿】の一員として様々な\n美食と出会われていたのですね\nわたくし、感服いたしました", 11, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (155, 80003, 1, 3, 0, 0, 105801, "ペコリーヌ", "これからもたくさん冒険をして\nめいっぱい美食を\n味わい尽くしましょうね！", 10, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (156, 80003, 0, 4, 0, 0, 105801, "ペコリーヌ", "2.5周年カウントダウン♪\nキャルちゃんキャルちゃん！\nわくわくしますね☆", 11, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (157, 80003, 1, 4, 0, 0, 106001, "キャル", "あぁもう、うるさいわね～\nまだまだ先でしょ？\nちょっとは落ち着きなさいよ", 12, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (158, 80003, 0, 4, 0, 0, 105801, "ペコリーヌ", "キャルちゃんだって最近\nソワソワしてるじゃないですか～\nさっきもご機嫌そうに鼻歌とか\n歌ってましたよね？", 12, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (159, 80003, 1, 4, 0, 0, 106001, "キャル", "なっ…！　き、聞いてたの！？\nじゃない、歌ってないわよ！？\nあんたいい加減なこと言うと\nぶっ殺すわよ！？", 13, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (160, 80003, 0, 4, 0, 0, 105801, "ペコリーヌ", "えっへへ～♪\nわたしは最近のキャルちゃんが\nもっともっと大好きですよ♪\nすごく積極的になりましたよね！", 13, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (161, 80003, 1, 4, 0, 0, 106001, "キャル", "…積極的？\nなんの話よ？", 14, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (162, 80003, 0, 4, 0, 0, 105801, "ペコリーヌ", "またまた～♪\nアイドルを目指そうとしたこと\n忘れちゃったんですか？", 14, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (163, 80003, 0, 4, 0, 0, 105801, "ペコリーヌ", "ムーサの町で\nきゃるきゃる～ん☆　って！", 15, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (164, 80003, 1, 4, 0, 0, 106001, "キャル", "あっ…！？　ちちち違うわよっ！\nあれは操られてただけで\nあたしはアイドルなんか\n目指してないっての！！", 15, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (165, 80003, 0, 4, 0, 0, 105801, "ペコリーヌ", "本当に本当ですか？\nわたし、キャルちゃんとっても\n乗り気だなって\n思ってたんですけど～", 16, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (166, 80003, 1, 4, 0, 0, 106001, "キャル", "まぁ、悪くはなかったけど…って\nだ、だから目指してないって\n言ってるでしょ！！\nなんてこと思い出させんのよ！？", 16, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (167, 80003, 1, 4, 0, 0, 106001, "キャル", "ああ…ダメだわ…\nもう殺すしかない…\n2.5周年が来る前に\n記憶ごと消し去ってやるー！", 17, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (168, 80003, 0, 5, 0, 0, 106001, "キャル", "2.5周年まであと10日…\nふ～ん？\n案外早いもんね？", 18, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (169, 80003, 1, 5, 0, 0, 105901, "コッコロ", "そうでございますね…\nその日のためにやるべきことは\nまだまだございます\n気を引き締めねばなりません…！", 12, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (170, 80003, 0, 5, 0, 0, 106001, "キャル", "やる気十分ねコロ助…\nそんな気負ってるとしんどいわよ？\nお気楽にやりましょ？", 19, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (171, 80003, 1, 5, 0, 0, 105901, "コッコロ", "キャルさま…\nありがとうございます\nキャルさまは本当に\n優しいおかたです", 13, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (172, 80003, 0, 5, 0, 0, 106001, "キャル", "な、なにわけの分かんないこと\n言ってんのよ…\nあたしは優しくなんかないっての", 20, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (173, 80003, 1, 5, 0, 0, 105901, "コッコロ", "そんなことはございません\n…あの、実はわたくし\nキャルさまに\nひとつお願いがございまして", 14, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (174, 80003, 0, 5, 0, 0, 106001, "キャル", "お願い？　珍しいわね\nコロ助がそんなこと言うなんて\n…まあ、あたしに出来ることなら\n別にいいけど", 21, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (175, 80003, 1, 5, 0, 0, 105901, "コッコロ", "ありがとうございます\n実は記念日へ向けて\n『かくし芸』というものを\n用意してみようかと思いまして", 15, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (176, 80003, 0, 5, 0, 0, 106001, "キャル", "かくし芸？", 22, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (177, 80003, 1, 5, 0, 0, 105901, "コッコロ", "はい。きゃるきゃる～ん☆　を\n参考に、ころころ～ん☆　という\nご挨拶を考えてみたのですが\nポーズがうまくいかなくて…", 16, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (178, 80003, 0, 5, 0, 0, 106001, "キャル", "～～！！　ちょっと褒められて\nいい気になって損したわ！！\nふざけんなふざけんな\nふ～ざ～け～ん～な～っ！！", 23, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (179, 80003, 0, 6, 0, 0, 105801, "ペコリーヌ", "あと９日！　もうすぐですよ♪\nえへへ、楽しみで楽しみで\nごはんが進みますね☆", 17, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (180, 80003, 2, 6, 0, 0, 106001, "キャル", "ごはんが進みますね☆\nじゃなーい！\nいくらなんでも食べ過ぎよ！\n記念日、迎えられなくなるわよ！？", 24, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (181, 80003, 1, 6, 0, 0, 105901, "コッコロ", "大丈夫ですよキャルさま\n食事はわたくしたちの\n歩んできた道そのもの\nなのですから", 17, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (182, 80003, 0, 6, 0, 0, 105801, "ペコリーヌ", "さっすがコッコロちゃん\nいいことを言いますね！\nそう、わたしたち\n【美食殿】の活動目的は─", 18, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (183, 80003, 2, 6, 0, 0, 106001, "キャル", "─みんなで楽しく食事をすること\nでしょ？\nあれだけ食べ歩いてきたんだから\n分かってるわよ", 25, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (184, 80003, 1, 6, 0, 0, 105901, "コッコロ", "はい…そうでございますね♪\nそれにしてもわたくしたち\n本当にいろいろなものを\n食べ歩いてきましたね…", 18, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (185, 80003, 2, 6, 0, 0, 106001, "キャル", "そうね…ほんっとうにね…\n毒まみれのニセドラゴンとか\n恐竜…は逃げられちゃったっけ\nあとワニゴ…ワニの魔物とかね", 26, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (186, 80003, 2, 6, 0, 0, 106001, "キャル", "そして、とうとう本物の\nドラゴンまで相手に\nしちゃったのよね、あたしたちって", 27, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (187, 80003, 2, 6, 0, 0, 106001, "キャル", "信じられない強さだったわね\nあのドラゴン…やっぱり\n作戦はしっかり立てていかないと\nダメよね", 28, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (188, 80003, 0, 6, 0, 0, 105801, "ペコリーヌ", "えへへ…☆\nキャルちゃんが色んなことを\n覚えていてくれて\nうれしいです♪", 19, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (189, 80003, 1, 6, 0, 0, 105901, "コッコロ", "わたくしも鮮明に覚えておりますよ\n主さまもきっと…♪", 19, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (190, 80003, 2, 6, 0, 0, 106001, "キャル", "あったり前でしょ！\n忘れないわよ、あんな滅茶苦茶な\nものばかり食べさせられて！\n…忘れられるわけ、ないじゃない", 29, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (191, 80003, 0, 7, 0, 0, 106001, "キャル", "ねえちょっと、ちょっと待って！？\nカリンから、2.5周年記念の\n生放送に出演してほしいって\n言われたんだけど！", 30, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (192, 80003, 0, 7, 0, 0, 106001, "キャル", "なんでそういう大事なことを\n急に言うわけ！？\nそんなの聞いてないわよ～！？", 31, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (193, 80003, 0, 7, 0, 0, 106001, "キャル", "いっぱい人に見られちゃうのよね？\nなんであたしがそんなこと…", 32, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (194, 80003, 0, 7, 0, 0, 106001, "キャル", "あー\nあー\n…声、これで大丈夫かしら？", 33, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (195, 80003, 0, 7, 0, 0, 106001, "キャル", "聞き取りにくいかもしれないわね…\nもうちょっと明るい方がいいかも\nえっと…こんな感じ？", 34, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (196, 80003, 0, 7, 0, 0, 106001, "キャル", "オイッスー☆", 35, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (197, 80003, 0, 7, 0, 0, 106001, "キャル", "……\nいや、ないわ\nいつもどおりが一番ね、うん", 36, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (198, 80003, 0, 7, 0, 0, 106001, "キャル", "もう、記念の生放送なんて\n超責任重大なやつじゃない…\nもしなにか失敗とかしたら…", 37, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (199, 80003, 0, 7, 0, 0, 106001, "キャル", "ど、どど、どうしよう！？\n緊張してきちゃった…！！", 38, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (200, 80003, 0, 8, 0, 0, 105901, "コッコロ", "主さま、わたくし\nペコリーヌさまとキャルさまと共に\n2.5周年を祝う生放送に\n出演する大役を仰せつかりました", 20, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (201, 80003, 0, 8, 0, 0, 105901, "コッコロ", "多くの方々に\n『プリンセスコネクト！\nRe:Dive』の魅力をお伝えする\n重要な役割でございます", 21, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (202, 80003, 0, 8, 0, 0, 105901, "コッコロ", "わたくし、全身全霊をもって\n生放送に取り組みたいと\n思っております", 22, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (203, 80003, 0, 8, 0, 0, 105901, "コッコロ", "ですが、もしかしたら\nセリフを噛んでしまったり\n段取りを間違えてしまったり\nするかもしれません…", 23, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (204, 80003, 0, 8, 0, 0, 105901, "コッコロ", "そのようなことがないよう\n練習はしっかりしておかなくては\nまずはこちらから…", 24, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (205, 80003, 0, 8, 0, 0, 105901, "コッコロ", "オイッスー☆", 25, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (206, 80003, 0, 8, 0, 0, 105901, "コッコロ", "先ほどキャルさまが練習されて\nいるのをお見かけしたので\nわたくしもと思いまして…\nいかがでしょうか？", 26, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (207, 80003, 0, 8, 0, 0, 105901, "コッコロ", "良い感じ、ですか？\n…ふふ、ありがとうございます\n主さまのあたたかいお言葉があれば\nわたくしは百人力でございます", 27, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (208, 80003, 0, 8, 0, 0, 105901, "コッコロ", "この大役を無事に成し遂げ\n主さまに素敵な2.5周年を\n迎えていただけるよう…\nわたくし、尽力いたしますね", 28, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (209, 80003, 0, 9, 0, 0, 105801, "ペコリーヌ", "オイッスー☆", 20, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (210, 80003, 0, 9, 0, 0, 105801, "ペコリーヌ", "…う～ん、今のはちょっと\n違う感じがしますね\n堅苦しかったかもしれません", 21, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (211, 80003, 0, 9, 0, 0, 105801, "ペコリーヌ", "あと６日で2.5周年ですか…", 22, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (212, 80003, 0, 9, 0, 0, 105801, "ペコリーヌ", "この年月がオイッスーの\n歴史なんだと思うと\nじ～んとしちゃいます！\nやばいですね☆", 23, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (213, 80003, 0, 9, 0, 0, 105801, "ペコリーヌ", "生放送で最高のオイッスー☆　を\nみなさんにお届けするために\n頑張らないと！\nそれじゃあもう一度…", 24, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (214, 80003, 0, 9, 0, 0, 105801, "ペコリーヌ", "オイッスー☆", 25, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (215, 80003, 0, 9, 0, 0, 105801, "ペコリーヌ", "…うう～ん、どうしてでしょう\nまだ何かが違う気がします…\nもしかしたら\nおなかが空きすぎてるとか？", 26, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (216, 80003, 0, 9, 0, 0, 105801, "ペコリーヌ", "今さっき食べたばっかりですけど\nおなかが減っては\n良いオイッスー☆　は\n出せませんよね！", 27, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (217, 80003, 0, 9, 0, 0, 105801, "ペコリーヌ", "そうと決まれば、コッコロちゃんと\nキャルちゃんを誘って\nごはんにしましょう！\n善は急げです！", 28, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (218, 80003, 0, 9, 0, 0, 105801, "ペコリーヌ", "あ、二人が丁度いいところに！\nオイッス～☆　…ああ！！\n今の、今のですよ～♪", 29, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (219, 80003, 0, 9, 0, 0, 105801, "ペコリーヌ", "なるほど、どんな時も\n自然体が一番ってことですね！\nこの調子で、生放送も\n頑張っちゃいます♪", 30, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (220, 80003, 0, 10, 0, 0, 105801, "ペコリーヌ", "2.5周年まで残り５日ですが\nその前にもうすぐ生放送ですよ！\nコッコロちゃん\n準備の方はどうですか？", 31, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (221, 80003, 1, 10, 0, 0, 105901, "コッコロ", "はい。わたくし、しっかりと\n備えてまいりました\n万事抜かりはございません", 29, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (222, 80003, 0, 10, 0, 0, 105801, "ペコリーヌ", "おお～すごい自信を感じます…！\nいい生放送になりそうですね☆\n……あれ？　なんだかこの辺り\n揺れていませんか？", 32, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (223, 80003, 2, 10, 0, 0, 106001, "キャル", "…………", 39, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (224, 80003, 1, 10, 0, 0, 105901, "コッコロ", "キャルさま？\nお風邪をひかれたんでしょうか\nひどい震えですが…", 30, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (225, 80003, 2, 10, 0, 0, 106001, "キャル", "かかかか風邪じゃないわよ！\nここここれはただ\nななな生放送が楽しみ過ぎて\nワワワワクワクが止まらないだけ！", 40, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (226, 80003, 0, 10, 0, 0, 105801, "ペコリーヌ", "大丈夫ですかキャルちゃん！？\nそうだ、これを飲んでください！", 33, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (227, 80003, 2, 10, 0, 0, 106001, "キャル", "きき気がきくじゃない、ありがとっ\nごくっ、んく…ぶはぁっ！？\nちょっと何飲ませたの！？\n辛っ！　苦ぁ！？　甘ぁっ！？", 41, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (228, 80003, 0, 10, 0, 0, 105801, "ペコリーヌ", "これは魔物のエキスに薬草に\nその他色んなものを混ぜた\n特製の栄養ドリンクです！", 34, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (229, 80003, 0, 10, 0, 0, 105801, "ペコリーヌ", "これを飲めば体ぽかぽかで\n元気いっぱいですよ♪", 35, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (230, 80003, 2, 10, 0, 0, 106001, "キャル", "このアホリーヌ！\n風邪じゃないって言ったでしょ！？\nどさくさに紛れて\nそんな恐ろしいもん飲ませんな～！", 42, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (231, 80003, 1, 10, 0, 0, 105901, "コッコロ", "キャルさま\n震えが収まっておりますね\nよかったです…\nわたくし、心配いたしました", 31, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (232, 80003, 2, 10, 0, 0, 106001, "キャル", "え？　ああ、ホントね…って\nだから風邪じゃないって\n言ってるのに…\nまあいいわこの際なんでも", 43, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (233, 80003, 0, 10, 0, 0, 105801, "ペコリーヌ", "えっへへ～♪　いつも通りの\nキャルちゃんに戻りましたし\n素敵な生放送が出来そうですね！\n今から楽しみです☆", 36, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (234, 80003, 0, 11, 0, 0, 190801, "カリン", "ランドソルのみなさま、こんにちは\n生放送の会場設営を担当しています\n【ギルド管理協会】のカリンです", 6, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (235, 80003, 0, 11, 0, 0, 190801, "カリン", "【美食殿】のみなさんは\nまもなく始まる生放送に向けて\n最後の調整のため\n席を外しています", 7, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (236, 80003, 0, 11, 0, 0, 190801, "カリン", "頑張っている３人の\n邪魔をするわけには\nいきませんので、ご容赦ください", 8, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (237, 80003, 0, 11, 0, 0, 190801, "カリン", "ですので、本日は私から\n【美食殿】のみなさんの様子を\nお伝えさせていただこうと思います", 9, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (238, 80003, 0, 11, 0, 0, 190801, "カリン", "まずはペコリーヌさんですが…\n何やら大量のおにぎりを\n食べているようです\nえっと…栄養は大事ですよね", 10, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (239, 80003, 0, 11, 0, 0, 190801, "カリン", "次にコッコロさんですが\nこちらは発声練習をしています", 11, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (240, 80003, 0, 11, 0, 0, 190801, "カリン", "一生懸命、小さなお口を開けて\n声を出す姿が応援したくなりますね", 12, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (241, 80003, 0, 11, 0, 0, 190801, "カリン", "そしてキャルさんは…\nこれは…堂々としたものですね\n何もせず、ただ立ち尽くして…", 13, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (242, 80003, 0, 11, 0, 0, 190801, "カリン", "あれ？\nもしかして緊張で気を失って…？", 14, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (243, 80003, 0, 11, 0, 0, 190801, "カリン", "…ええと\n【美食殿】のみなさんは\nやる気十分なようですね！", 15, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (244, 80003, 0, 11, 0, 0, 190801, "カリン", "３人とも生放送を\nいいものにしようと\n全力で頑張ってくれていますので\nどうかご期待ください", 16, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (245, 80003, 0, 11, 0, 0, 190801, "カリン", "それでは\nまた明日お会いしましょう♪", 17, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (246, 80003, 0, 12, 0, 0, 106001, "キャル", "2.5周年まであと３日！\nそして生放送は明日！\nなんかいよいよって感じね…", 44, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (247, 80003, 2, 12, 0, 0, 105801, "ペコリーヌ", "３人でい～っぱい練習しましたし\nきっと大丈夫ですよ☆", 37, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (248, 80003, 1, 12, 0, 0, 105901, "コッコロ", "ペコリーヌさまに\n大丈夫と言ってもらえると\nとても心強いですね", 32, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (249, 80003, 0, 12, 0, 0, 106001, "キャル", "信じすぎちゃだめよコロ助\nこいつはなーんにも\n考えてないだけなんだから", 45, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (250, 80003, 2, 12, 0, 0, 105801, "ペコリーヌ", "ひどいですよぉキャルちゃ～ん！", 38, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (251, 80003, 1, 12, 0, 0, 105901, "コッコロ", "ふふ。お二人とも\n普段通りの様子で\n安心いたしました", 33, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (252, 80003, 2, 12, 0, 0, 105801, "ペコリーヌ", "はいっ☆\n生放送でもなんでも\n全力全開、わたしらしく\nぶつかっていくだけです！", 39, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (253, 80003, 0, 12, 0, 0, 106001, "キャル", "そうね。おめでたいことなんだし\nここまで来たんなら\n楽しめるだけ\n楽しむしかないわよね！", 46, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (254, 80003, 1, 12, 0, 0, 105901, "コッコロ", "わたくしも、普段よりも心が\n熱くなっております\nこの胸の気持ちをお伝えできるよう\n精一杯努力いたします…！", 34, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (255, 80003, 2, 12, 0, 0, 105801, "ペコリーヌ", "それでは、いきましょう！\n明日の生放送、絶対に\n成功させましょうね☆", 40, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (256, 80003, 0, 13, 0, 0, 105801, "ペコリーヌ", "えっと、最初のひと言は…あれ？\nキャルちゃん、わたし\n何て言うんでしたっけ？", 41, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (257, 80003, 2, 13, 0, 0, 106001, "キャル", "は！？\nなにいきなりど忘れしてるの！？\nっていうかあんた、台本は！？", 47, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (258, 80003, 0, 13, 0, 0, 105801, "ペコリーヌ", "忘れてきちゃいました☆", 42, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (259, 80003, 2, 13, 0, 0, 106001, "キャル", "忘れてきちゃいました☆\nで済ませられると思ってんの！？\nほら、あたし二冊持ってきたから\nこれ使いなさい！", 48, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (260, 80003, 1, 13, 0, 0, 105901, "コッコロ", "マイクとは、こんな高い位置に\nあるものなのですね…！\n背伸びをすれば、何とか…\nう～ん、うぅ～ん…！", 35, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (261, 80003, 2, 13, 0, 0, 106001, "キャル", "あぁもう\n少し下げればいいでしょ！？\nこれくらいでいい？\nまったく、世話が焼けるわね…", 49, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (262, 80003, 0, 13, 0, 0, 105801, "ペコリーヌ", "あれ？\nキャルちゃん、後ろ髪が\nはねちゃってますよ？", 43, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (263, 80003, 2, 13, 0, 0, 106001, "キャル", "え？　うそっ！？\nちゃんと確かめてきたのに！\nどこどこ！？", 50, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (264, 80003, 1, 13, 0, 0, 105901, "コッコロ", "キャルさま、動かないで\nくださいまし。今くしで…\nはい、直りましたよ", 36, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (265, 80003, 2, 13, 0, 0, 106001, "キャル", "あ、ありがと…はぁ。生放送\n本番までもうすぐなのに\nこんなことしてる場合じゃ\nないわよね", 51, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (266, 80003, 1, 13, 0, 0, 105901, "コッコロ", "はい、時間は残りわずかです\nですが、慌ただしく\n動き回るこの時間も\nなんだか楽しくて…♪", 37, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (267, 80003, 2, 13, 0, 0, 106001, "キャル", "コロ助、あんた…って\nそうじゃなくて！\n胸にジンワリきてる\n暇なんかないでしょ…！？", 52, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (268, 80003, 0, 13, 0, 0, 105801, "ペコリーヌ", "あはは♪\nキャルちゃんの動きが\nとっても面白いです♪\nやばいですね☆", 44, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (269, 80003, 1, 13, 0, 0, 105901, "コッコロ", "ふふ\nきっと面白い生放送になると\nわたくし、確信しております", 38, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (270, 80003, 0, 13, 0, 0, 105801, "ペコリーヌ", "絶対絶対、間違いありません！\n見てくれるみなさんが\n笑顔になれる時間を\nお届けしましょう！", 45, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (271, 80003, 2, 13, 0, 0, 106001, "キャル", "そんなの当然でしょ！\n誰が見たって面白いって\n言ってもらえるように\nあれだけ準備したんだから！", 53, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (272, 80003, 0, 13, 0, 0, 105801, "ペコリーヌ", "それでは\n記念日直前生放送！\n楽しみにしててくださいね☆", 46, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (273, 80003, 0, 14, 0, 0, 190801, "カリン", "こんにちは\n【ギルド管理協会】のカリンです", 18, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (274, 80003, 0, 14, 0, 0, 190801, "カリン", "昨日の生放送は\nいかがだったでしょうか？", 19, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (275, 80003, 0, 14, 0, 0, 190801, "カリン", "たくさんの笑顔と喜びと\nそして驚きを受け取って\nいただけたのではないかと思います", 20, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (276, 80003, 0, 14, 0, 0, 190801, "カリン", "そしていよいよ\n明日は2.5周年の当日\n待ちに待った記念日を\n迎えることとなります", 21, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (277, 80003, 0, 14, 0, 0, 190801, "カリン", "【美食殿】のみなさんも\n張り切って様々な準備を\nされていますよ", 22, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (278, 80003, 0, 14, 0, 0, 190801, "カリン", "【ギルド管理協会】も\n万全のサポート体制で\n協力してまいりたいと思います", 23, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (279, 80003, 0, 14, 0, 0, 190801, "カリン", "…ふふ、本当に楽しみですね\n【ギルド管理協会】の職員として\nだけではなく、私個人としても…", 24, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (280, 80003, 0, 14, 0, 0, 190801, "カリン", "この記念日を迎えられることが\n心から楽しみですし\n幸せを感じています", 25, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (281, 80003, 0, 14, 0, 0, 190801, "カリン", "きっと【美食殿】のみなさんは\nそれ以上に心を弾ませて\nいることでしょう", 26, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (282, 80003, 0, 14, 0, 0, 190801, "カリン", "それでは\n明日からの2.5周年を\nどうぞ、お楽しみに…♪", 27, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (283, 80003, 0, 15, 0, 0, 105801, "ペコリーヌ", "準備はいいですかっ？\n…いっきますよー！", 47, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (284, 80003, 2, 15, 0, 0, 106001, "キャル", "祝！", 54, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (285, 80003, 1, 15, 0, 0, 105901, "コッコロ", "2.5周年！", 39, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (286, 80003, 0, 15, 0, 0, 105801, "ペコリーヌ", "おめでとうございま～す☆", 48, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (287, 80003, 2, 15, 0, 0, 106001, "キャル", "少し前まではまだまだ先じゃない\nとか言ってたけど\n本当にあっという間だったわね", 55, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (288, 80003, 1, 15, 0, 0, 105901, "コッコロ", "光陰矢の如し…\nとはこのことでございますね\nでも、今日という日を無事に\n迎えることができて良かったです", 40, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (289, 80003, 0, 15, 0, 0, 105801, "ペコリーヌ", "コッコロちゃん！　キャルちゃん！\n落ち着くには\nまだ早いですよ！\n盛り上がるのはこれからです☆", 49, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (290, 80003, 2, 15, 0, 0, 106001, "キャル", "ほんとあんたはいつも\n全力全開ねー\nでもそうね、記念日なんだし\nパーっといきましょ！", 56, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (291, 80003, 1, 15, 0, 0, 105901, "コッコロ", "ええ、わたくしも全力全開で\nまいります…！\n主さま、さあ\nどうぞ手を取ってくださいまし…♪", 41, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (292, 80003, 2, 15, 0, 0, 106001, "キャル", "あんたもコロ助も、浮かれて\n転ぶんじゃないわよ？\n…仕方ないから、あたしも\n手を繋いであげるわよ", 57, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (293, 80003, 0, 15, 0, 0, 105801, "ペコリーヌ", "あー！　二人ともずるいです！\nわたしもっ、ギュー♪", 50, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (294, 80003, 2, 15, 0, 0, 106001, "キャル", "ちょっ、ペコリーヌ！\nくっつき過ぎよ！", 58, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (295, 80003, 0, 15, 0, 0, 105801, "ペコリーヌ", "記念日だから\n平気平気♪\nやばいですね☆", 51, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (296, 80003, 2, 15, 0, 0, 106001, "キャル", "意味分かんないわよ！", 59, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (297, 80003, 1, 15, 0, 0, 105901, "コッコロ", "ふふ。このめでたき日に\n喜びがあふれておりますね\n主さまは…いかがでしょうか？", 42, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (298, 80003, 1, 15, 0, 0, 105901, "コッコロ", "喜んでいただけているならば\nわたくしはとてもとても\n幸せでございます", 43, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (299, 80003, 0, 15, 0, 0, 105801, "ペコリーヌ", "さぁ、2.5周年を\n楽しみ尽くしますよ☆\nまだまだ食べたいものもありますし\nやりたいこともたくさんです！", 52, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (300, 80003, 2, 15, 0, 0, 106001, "キャル", "分かった、分かったから\n引っ張るんじゃないわよ！\n…そんな掴まなくても\nちゃんとついていくから", 60, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (301, 80003, 1, 15, 0, 0, 105901, "コッコロ", "ペコリーヌさま…キャルさま…\n主さま…共にまいりましょう\nどこまでも…！", 44, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (302, 80003, 0, 15, 0, 0, 105801, "ペコリーヌ", "はい！　それでは2.5周年\n食べつくしツアーへ！\nそして、その先の未来へ\n向かって出発しましょう！", 53, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (303, 80003, 0, 15, 0, 0, 105801, "ペコリーヌ・コッコロ・キャル", "2.5周年\nありがとうございます！", 54, 1, "105901,45,106001,61");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (304, 60002, 1, 0, 0, 1, 190804, "カリン", "新年を迎え、新たに始まる一日を\nおみくじで占ってみませんか？\n良い運勢であるほど、\n沢山のプレゼントが貰えますよ♪", 1, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (305, 60002, 2, 0, 1, 1, 0, "", "今日の運勢は姫吉！　どんな不可能も可能にできちゃう！　　　　仲間と食卓を囲めばさらに運気上昇よ！　ただし魔物料理以外！", 0, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (306, 60002, 2, 0, 1, 1, 0, "", "今日の運勢は姫吉！　やること全てが最高潮！　やばいですね☆　ラッキーアイテムはおにぎり！　お腹一杯で幸せが続くでしょう！", 0, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (307, 60002, 2, 0, 1, 1, 0, "", "今日の運勢は姫吉！　最強の運勢でどんなドジも跳ね除けます！　大切な人と一緒に、最高の一日になること間違いなし！", 0, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (308, 60002, 2, 0, 1, 1, 0, "", "今日の運勢は姫吉！　どんな挑戦も上手くいく、最高の運勢です！理想の自分に変身できる絶好の機会！　新しい一歩を踏み出そう！", 0, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (309, 60002, 2, 0, 1, 2, 0, "", "今日の運勢は姫吉！　やること全てが上手くいく最高の一日！　　あなたの活躍に先生もにっこりです。いい子いい子♪", 0, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (310, 60002, 2, 0, 2, 1, 0, "", "今日の運勢は大吉！　お裁縫好きな女の子のお墨付きです！　　　お世話したがりの妹にめいっぱい愛されちゃうかも！？", 0, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (311, 60002, 2, 0, 2, 1, 0, "", "今日の運勢は大吉！　ラッキーカラーは赤！　　　　　　　　　　湧き上がるアイデアの数々に、高笑いが止まりませんわ！", 0, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (312, 60002, 2, 0, 2, 1, 0, "", "今日の運勢は大吉！　ラッキーワードは「ちぇる～ん♪」　　　　出会う人みんなに言ってあげると、ハッピーになれますよ！", 0, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (313, 60002, 2, 0, 2, 1, 0, "", "今日の運勢は大吉！　運勢はバッチリで無敵状態！　　　　　　　龍眼で全てを見通して、思い通りの一日を過ごしましょう！", 0, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (314, 60002, 2, 0, 2, 2, 0, "", "今日の運勢は大吉！　悩んでいたことが解決しそうです！　　　　たまには勉強も仕事も忘れて、心あたたまる家族と過ごしましょ！", 0, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (315, 60002, 2, 0, 3, 1, 0, "", "今日の運勢は中吉！　家の中でゆっくり過ごすのがよさそう！　　ラッキーアイテムはゲームよ！　ベストスコアを更新できるかも？", 0, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (316, 60002, 2, 0, 3, 1, 0, "", "今日の運勢は中吉！　上手くなりたいことに積極的に挑戦してみてサックス好きの妹が、手取り足取りサポートしてくれるかも～？", 0, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (317, 60002, 2, 0, 3, 1, 0, "", "今日の運勢は中吉！　仕事運が急上昇中です！　　　　　　　　　きっと「煉獄に舞う一陣の疾風」の如き活躍ができますよ！", 0, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (318, 60002, 2, 0, 3, 1, 0, "", "今日の運勢は中吉！　日頃の努力が報われます！　　　　　　　　親しい友人がいるなら報告してみて。一緒に喜んでくれるはずだ。", 0, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (319, 60002, 2, 0, 3, 1, 0, "", "今日の運勢は中吉！　商売運が上がってきています！　　　　　　ラッキーアイテムはたい焼き！　和菓子パワーで売上アップです！", 0, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (320, 60002, 2, 0, 3, 1, 0, "", "今日の運勢は中吉！　チャンスを待つと良い結果に！　　　　　　ラッキーアイテムのプリンを食べて、運を呼び込みましょう！", 0, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (321, 60002, 2, 0, 3, 2, 0, "", "今日の運勢は中吉！　運気が着々と上昇中！　　　　　　　　　　精霊の加護を受けたかのごとく、色々な事がうまくいきますよ♪", 0, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (322, 60002, 2, 0, 4, 1, 0, "", "今日の運勢は小吉！　まだ見ぬ危険が隠れているかも！　　　　　でも安心しろ！　提督が貴公を守ってくれるはずだぞ！", 0, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (323, 60002, 2, 0, 4, 1, 0, "", "今日の運勢は小吉！　いろんな事件が起こる一日になりそう！　　状況をよく観察してみようじゃないか！　まさに探偵のごとくね！", 0, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (324, 60002, 2, 0, 4, 1, 0, "", "今日の運勢は小吉！　気の向くままに過ごすのが幸せへの近道！　美味い魚を食べて猫を眺めて、自然体で過ごすのはどうだい？", 0, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (325, 60002, 2, 0, 4, 1, 0, "", "今日の運勢は小吉！　運気は高いけども、ハプニングには注意！　出かけた先で、「ふしんしゃ」扱いされてしまうかも……", 0, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (326, 60002, 2, 0, 4, 1, 0, "", "今日の運勢は小吉！　同腹一心の友だちが見つかるかも！　　　　キーワードは「ユニちゃんズ」、記憶に刻みましょう！", 0, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (327, 60002, 2, 0, 4, 1, 0, "", "今日の運勢は小吉！　周りに流されず、マイペースな一日を！　　ただし寝すぎには注意ぐうたらし過ぎず適度な運動を、だってさ～", 0, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (328, 60002, 2, 0, 4, 2, 0, "", "今日の運勢は小吉！　根を詰めずにリラックスすると運気向上！　ラッキーパーソンはアイドル。歌があなたを幸せにしてくれます♪", 0, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (329, 60002, 3, 0, 0, 0, 190804, "カリン", "おみくじの結果はどうでしたか？\n新たに始まる一日が、あなたに\nとって良い日になりますように\nまた明日も遊びに来て下さいね♪", 2, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (330, 60002, 3, 7, 0, 0, 190804, "カリン", "おみくじは楽しんで頂けましたか？\nあなたの新たなる年が\n素晴らしいものになるよう、\n心からお祈りいたします", 3, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (331, 80005, 4, 1, 0, 0, 105901, "コッコロ", "ささ、シェフィさまはこちらへ…", 1, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (332, 80005, 0, 1, 0, 0, 106401, "シェフィ", "コッコロさん、どこへ行くの…？\n…え？", 1, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (333, 80005, 3, 1, 0, 0, 105801, "ペコリーヌ", "『おめでとうございます！\nわ～パチパチー！』\n…という感じでどうですかね！？", 1, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (334, 80005, 4, 1, 0, 0, 105901, "コッコロ", "ではわたくしも\n後ろからクラッカーを鳴らして\n応戦いたします\nああ、当日が待ち遠しいですね", 2, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (335, 80005, 0, 1, 0, 0, 106401, "シェフィ", "ええと…\n二人とも何をしているの？", 2, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (336, 80005, 1, 1, 0, 0, 106001, "キャル", "シェフィは初めてだもんね\nあの日が近いからって\n予行練習してんのよ\n気が早いわよね～", 1, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (337, 80005, 0, 1, 0, 0, 106401, "シェフィ", "あの日…？", 3, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (338, 80005, 3, 1, 0, 0, 105801, "ペコリーヌ", "その通りです…\nいよいよ記念すべきあの日が\n近づいてきましたよ！", 2, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (339, 80005, 3, 1, 0, 0, 105801, "ペコリーヌ", "『プリンセスコネクト！\nRe:Dive』3.5周年！", 3, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (340, 80005, 2, 1, 0, 0, 190801, "カリン", "やばいですね☆", 1, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (341, 80005, 1, 1, 0, 0, 106001, "キャル", "って、なにしれっと\n参加してんのよカリン！", 2, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (342, 80005, 2, 1, 0, 0, 190801, "カリン", "ふふ、いいじゃないですか\n【ギルド管理協会】として\n私もみなさんと一緒に\nお祝いをさせてください！", 2, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (343, 80005, 2, 1, 0, 0, 190801, "カリン", "それに…記念日が近づけば\nとっておきの情報を\nお届けしますから♪", 3, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (344, 80005, 3, 1, 0, 0, 105801, "ペコリーヌ", "というわけで\n今日からシェフィちゃんも一緒に\nカウントダウンしちゃいましょう！\n3.5周年まで…", 4, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (345, 80005, 0, 1, 0, 0, 106401, "シェフィ", "えっ！？　ええとええと…！\nあ、あと14日…！", 4, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (346, 80005, 3, 2, 0, 0, 105801, "ペコリーヌ", "3.5周年まであと13日\n豪華に、そして盛大に\nお祝いしたいですね☆", 5, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (347, 80005, 1, 2, 0, 0, 105901, "コッコロ", "豪華といえば前にとある貴族さまが\n舞踏会を開かれたそうで\n主さまがそのお手伝いを\nしておりました", 3, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (348, 80005, 1, 2, 0, 0, 105901, "コッコロ", "そこで美しい所作を学ばれたので\nわたくしも教えていただきました\nしゃなり、しゃなり…\nいかがでしょう？", 4, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (349, 80005, 3, 2, 0, 0, 105801, "ペコリーヌ", "すっごく上手ですよ☆\nまるでお姫様みたいです\nせっかくなのでわたしも\nしゃなりしゃなり", 6, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (350, 80005, 1, 2, 0, 0, 105901, "コッコロ", "さすがでございます\nペコリーヌさま", 5, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (351, 80005, 0, 2, 0, 0, 106001, "キャル", "いや、あんたは\nできなきゃダメでしょ\n本物のお姫様なんだし", 3, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (352, 80005, 2, 2, 0, 0, 106401, "シェフィ", "しゃなり、しゃなり…\nふふ、案外できるものね", 5, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (353, 80005, 3, 2, 0, 0, 105801, "ペコリーヌ", "わぁ！\nシェフィちゃん\n姿勢がとってもキレイです♪", 7, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (354, 80005, 1, 2, 0, 0, 105901, "コッコロ", "さ、次はキャルさまの\n番でございますよ", 6, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (355, 80005, 0, 2, 0, 0, 106001, "キャル", "あ、あたしはいいわよ！\nそういうの全然分かんないし…", 4, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (356, 80005, 2, 2, 0, 0, 106401, "シェフィ", "大丈夫\nやってみると結構楽しいわよ\nほらほらっ", 6, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (357, 80005, 0, 2, 0, 0, 106001, "キャル", "そ、そこまで言うなら…\nしゃなにゅわきゃあっ！", 5, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (358, 80005, 0, 2, 0, 0, 106001, "キャル", "いたたた…もぉお～！\nなんであたしがこんな目に～！", 6, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (359, 80005, 1, 2, 0, 0, 105901, "コッコロ", "まぁまぁ\n記念日までに練習すれば\nできるようになるかもしれません\nよろしければお教えいたしますよ", 7, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (360, 80005, 0, 2, 0, 0, 106001, "キャル", "よし！\nあんたたちができて\nあたしだけできないのはしゃくだし\nやってやろうじゃないの！！", 7, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (361, 80005, 1, 3, 0, 0, 105901, "コッコロ", "3.5周年まであと12日\n記念日当日はもちろんですが\nその日を待つ時間というのも\n心躍ります", 8, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (362, 80005, 3, 3, 0, 0, 105801, "ペコリーヌ", "分かりますっ！\nどんな特別な料理を食べられるのか\n考えるだけでワクワクしますよね！", 8, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (363, 80005, 1, 3, 0, 0, 105901, "コッコロ", "特別な料理といえば、お祭りですね\nそういえば主さまは学生として\n聖学祭に参加されたこと\nがあるとか…", 9, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (364, 80005, 2, 3, 0, 0, 106401, "シェフィ", "聖学祭…って、なにかしら？", 7, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (365, 80005, 1, 3, 0, 0, 105901, "コッコロ", "聖テレサ女学院の祭典ですよ\n二つのチームが競い合い\n青春を満喫するのが趣旨のようです", 10, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (366, 80005, 0, 3, 0, 0, 106001, "キャル", "それってカルミナの\nサプライズライブがあった\nお祭りよね？\nちょっと見たかったかも…", 8, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (367, 80005, 0, 3, 0, 0, 106001, "キャル", "カルミナの後の\nライブも好評だったらしいじゃない\n確か、なかよし部\nだったっけ…？", 9, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (368, 80005, 3, 3, 0, 0, 105801, "ペコリーヌ", "なかよし部…\n仲が良さそうな名前で\nやばいですね☆", 9, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (369, 80005, 0, 3, 0, 0, 106001, "キャル", "いや、そのまんますぎでしょ…", 10, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (370, 80005, 2, 3, 0, 0, 106401, "シェフィ", "聖学祭かぁ…なんだか楽しそうね\nそれになかよし部の人たちも\n気になるわ", 8, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (371, 80005, 3, 3, 0, 0, 105801, "ペコリーヌ", "それじゃあわたしたちも、\n負けじと仲良くしましょう♪\nほらほらシェフィちゃん、\nぎゅーっ☆　ですよ♪", 10, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (372, 80005, 2, 3, 0, 0, 106401, "シェフィ", "えっ？　ええ…\nぎゅーっ…？", 9, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (373, 80005, 0, 4, 0, 0, 106001, "キャル", "3.5周年まであと11日！？\nお祝いの準備進んでないんだけど…\nああ～昨日に戻りたいわ…", 11, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (374, 80005, 2, 4, 0, 0, 106401, "シェフィ", "そういえばそんな魔道具があるって\n聞いたことがあるわね\n確か、名前はタイムラーベ…", 10, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (375, 80005, 0, 4, 0, 0, 106001, "キャル", "なにそれヤバいわね\nでも本当にあるんだったら\n準備よりももっとやり直したいこと\nたくさんあるんだけど…", 12, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (376, 80005, 1, 4, 0, 0, 105901, "コッコロ", "もしや正月の件でしょうか…？\nあの時はお金がなくて\n苦労しましたから", 11, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (377, 80005, 0, 4, 0, 0, 106001, "キャル", "あれはそうね…\nお金を湯水のように使う\nぺコリーヌを止められたら\nあんな苦労をすることもなかったし", 13, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (378, 80005, 3, 4, 0, 0, 105801, "ペコリーヌ", "そんなこともありましたね！\nやり直したいといえば\n『きゃるきゃる～ん♪』\nの方かと思いましたよ！", 11, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (379, 80005, 0, 4, 0, 0, 106001, "キャル", "バラすんじゃないわよ\nこのアホリーヌ！\nシェフィはそれ\n知らないんだから！", 14, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (380, 80005, 0, 4, 0, 0, 106001, "キャル", "こうなったらもう、なんとか\nタイムラーべを探し出して\n今の会話をなかったことに…\nって、どうしたのよシェフィ", 15, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (381, 80005, 2, 4, 0, 0, 106401, "シェフィ", "うん…もし、私だったら…\n私が知らないみんなとの時間を\n見てみたいな、って…", 11, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (382, 80005, 3, 4, 0, 0, 105801, "ペコリーヌ", "シェフィちゃん！　タイムなんとか\nなんかなくても大丈夫ですよ！\n一緒の時間はこれから\nどんどん作ればいいんですから！", 12, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (383, 80005, 1, 4, 0, 0, 105901, "コッコロ", "はい、今この瞬間も\n未来にはかけがえのない思い出に\nなっていることでしょう", 12, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (384, 80005, 0, 4, 0, 0, 106001, "キャル", "だからそんな顔しないの\nほら、お祝いの準備、進めるわよ！", 16, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (385, 80005, 2, 4, 0, 0, 106401, "シェフィ", "みんな…そうね\n最高のお祝いにして\n最高の思い出にしましょう！", 12, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (386, 80005, 3, 5, 0, 0, 105801, "ペコリーヌ", "3.5周年まで、あと10日！\nもうすぐですよー！\n楽しみすぎて、やばいですね！", 13, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (387, 80005, 3, 5, 0, 0, 105801, "ペコリーヌ", "そういえば…たくさんのおもちゃが\n子どもたちを襲うっていう\n騒動もありましたね…\nなんでも勝手に動き出したとか！", 14, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (388, 80005, 3, 5, 0, 0, 105801, "ペコリーヌ", "学校や孤児院とかに\nちっちゃなおもちゃが乗り込んで\n暴れたみたいですよ！", 15, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (389, 80005, 0, 5, 0, 0, 106001, "キャル", "暴れたって言っても\n所詮はおもちゃじゃない\nどうせちっさいんでしょ？", 17, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (390, 80005, 0, 5, 0, 0, 106001, "キャル", "だったら魔法で\n全部ぶっ飛ばせばいいじゃない！\n大したことないわよ！", 18, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (391, 80005, 2, 5, 0, 0, 106401, "シェフィ", "キャルってば…\n相手は子どもが\n大事にしてる物なのよ…？", 13, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (392, 80005, 1, 5, 0, 0, 105901, "コッコロ", "乱暴な発言は\nめっ、でございますよ？\n子どもの教育に悪影響を\n与えてしまいますから…", 13, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (393, 80005, 3, 5, 0, 0, 105801, "ペコリーヌ", "キャルちゃんだって\n意外と猫グッズとか\nたっくさん集めてますよね？\nもしその子たちが暴れたら…？", 16, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (394, 80005, 0, 5, 0, 0, 106001, "キャル", "う、うっさいわね！\n意外とか言うな！\n…ま、まあ確かに正面切って\n魔法でぶっ飛ばせないかもね…", 19, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (395, 80005, 3, 5, 0, 0, 105801, "ペコリーヌ", "あはは☆\nキャルちゃんのそういうところ\n好きですよ♪", 17, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (396, 80005, 3, 5, 0, 0, 105801, "ペコリーヌ", "そんなキャルちゃんに猫グッズを\nプレゼントしちゃいますね！\n一部で流行っていた、たい焼き屋の\nおまけフィギュアですよ♪", 18, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (397, 80005, 3, 5, 0, 0, 105801, "ペコリーヌ", "乱暴に扱ったりしないでくださいね\nひとりでに暴れ出しちゃうかも\nしれませんから！", 19, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (398, 80005, 2, 6, 0, 0, 190801, "カリン", "3.5周年まであと９日\nここでみなさんに\nビックニュースですよ！", 4, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (399, 80005, 2, 6, 0, 0, 190801, "カリン", "3.5周年を祝う生放送に\n去年と同様【美食殿】の\nみなさんにご出演いただくことが\n決定しましたー！", 5, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (400, 80005, 1, 6, 0, 0, 106001, "キャル", "…えっ！？", 20, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (401, 80005, 3, 6, 0, 0, 105801, "ペコリーヌ", "本当ですか！？\nそれじゃ今から張り切って\n生放送中に食べる魔物料理を\n作らなくちゃですね☆", 20, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (402, 80005, 0, 6, 0, 0, 106401, "シェフィ", "いや…がんばるところは\nそこじゃないような…\nというか去年も出演してたのね\nすごいじゃない！", 14, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (403, 80005, 4, 6, 0, 0, 105901, "コッコロ", "はい。とても緊張しますが\nやりがいのある大役です\n一緒にがんばりましょうね\nシェフィさま", 14, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (404, 80005, 0, 6, 0, 0, 106401, "シェフィ", "わ、私も出るの！？　でも…\n私も【美食殿】の一人だものね\nそれなら今からしっかり準備をして\nコンディションを整えないと…", 15, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (405, 80005, 1, 6, 0, 0, 106001, "キャル", "ふふん♪\n生放送直前のカチコチになった\nシェフィの姿が楽しみだわ！", 21, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (406, 80005, 3, 6, 0, 0, 105801, "ペコリーヌ", "去年のキャルちゃんは\n緊張しすぎてずっと震えて\nかわいかったですもんね！\n今年もあの姿が見たいです！", 21, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (407, 80005, 1, 6, 0, 0, 106001, "キャル", "ぶっ殺すぞ！？", 22, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (408, 80005, 2, 6, 0, 0, 190801, "カリン", "というわけで\n『プリンセスコネクト！\nRe:Dive』の魅力を\nお伝えする生放送をお楽しみに♪", 6, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (409, 80005, 1, 7, 0, 0, 105901, "コッコロ", "3.5周年まであと８日\nでございますよ\n楽しみですね、主さま", 15, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (410, 80005, 0, 7, 0, 0, 106001, "キャル", "そういえばあんた\n夏休みの宿題は\nきちんとやってるの？", 23, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (411, 80005, 2, 7, 0, 0, 106401, "シェフィ", "宿題…学校に通うのも\n楽しいことばかりじゃ\nないのね", 16, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (412, 80005, 3, 7, 0, 0, 105801, "ペコリーヌ", "あれ？　そういえば\n少し前にルーセント学院で\n何かあったような…", 22, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (413, 80005, 0, 7, 0, 0, 106001, "キャル", "ああ、始業式の日に\n大捕り物があったって\n話題になってたわね", 24, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (414, 80005, 2, 7, 0, 0, 106401, "シェフィ", "夏休みを終わらせないって\n騒いでたっていう話？\nあれ本当なの？\n都市伝説だと思ってたわ", 17, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (415, 80005, 1, 7, 0, 0, 105901, "コッコロ", "その一件ならよく存じ上げて\nおります。ですから主さま\n次の機会にはわたくしと一緒に\nがんばりましょう", 16, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (416, 80005, 2, 7, 0, 0, 106401, "シェフィ", "楽しそう…私も一緒にやりたいな\nママ…じゃ、じゃなくて！\nコッコロさん、私もまざっていい？", 18, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (417, 80005, 1, 7, 0, 0, 105901, "コッコロ", "もちろんでございます\n仲良くお勉強いたしましょう", 17, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (418, 80005, 0, 7, 0, 0, 106001, "キャル", "しれっと教育ママが\n生まれてる…？", 25, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (419, 80005, 3, 7, 0, 0, 105801, "ペコリーヌ", "お勉強は大切ですよ！\nキャルちゃんも一緒に\nがんばりましょう！", 23, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (420, 80005, 0, 7, 0, 0, 106001, "キャル", "え～～～～！？", 26, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (421, 80005, 0, 8, 0, 0, 106001, "キャル", "3.5周年まであと７日〜♪\nふふ～ん♪\nふんふふ～ん♪", 27, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (422, 80005, 2, 8, 0, 0, 106401, "シェフィ", "…\nねぇコッコロさん\nキャル、どうしちゃったの？", 19, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (423, 80005, 1, 8, 0, 0, 105901, "コッコロ", "とてもご機嫌そうに\n鼻歌を歌ってらっしゃいますね\n耳も尻尾もリズミカルに\n揺れて…ノリノリでございます", 18, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (424, 80005, 3, 8, 0, 0, 105801, "ペコリーヌ", "あれはですね！\nカルミナのみなさんの\nサマーライブのチケットが\n手に入ったからなんですよ♪", 24, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (425, 80005, 2, 8, 0, 0, 106401, "シェフィ", "ええっ！？\nあのライブのチケットって確か\n入手困難だったんじゃ…", 20, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (426, 80005, 0, 8, 0, 0, 106001, "キャル", "ふふふふ～ん♪\nしゃいにんぐふゅ～ちゃ～♪", 28, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (427, 80005, 1, 8, 0, 0, 105901, "コッコロ", "なるほど…\nキャルさまがあのように\nなってしまうのも頷けますね", 19, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (428, 80005, 2, 8, 0, 0, 106401, "シェフィ", "…カルミナの\n『Shining Future』\nの中に、シャイニングフューチャー\nって歌詞はなかったはずだけど…", 21, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (429, 80005, 0, 8, 0, 0, 106001, "キャル", "ふんふ…はっ！？\nあっ、あんたたち！\nなに人の鼻歌を\n勝手に聞いてるのよ！？", 29, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (430, 80005, 0, 8, 0, 0, 106001, "キャル", "こっ、これは別に\nカルミナの曲じゃなくて…\nあたしのオリジナルソングよ！\n聞いたらお金取るわよっ！？", 30, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (431, 80005, 3, 8, 0, 0, 105801, "ペコリーヌ", "えへへ、キャルちゃん\nカルミナのサマーライブ\n思いっきり楽しみましょうね☆", 25, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (432, 80005, 0, 8, 0, 0, 106001, "キャル", "も～っ！\n生暖かい目で見るな～～！\nぶっ殺すわよ～～～！", 31, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (433, 80005, 0, 9, 0, 0, 106401, "シェフィ", "3.5周年まであと６日\n３人も言ってたけど\nあっという間だったわね", 22, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (434, 80005, 0, 9, 0, 0, 106401, "シェフィ", "…えっ？\n生放送の意気込み！？\n突然なに！？", 23, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (435, 80005, 0, 9, 0, 0, 106401, "シェフィ", "ええと…\nとにかく失敗しないように\n台本たくさん読んで…\nそれから…", 24, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (436, 80005, 0, 9, 0, 0, 106401, "シェフィ", "えっ！？\nトラブルがあったら\nどうするのかって！？\nそ、それは…！", 25, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (437, 80005, 0, 9, 0, 0, 106401, "シェフィ", "とにかく落ち着いて\nスタッフさんの指示を聞いて…", 26, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (438, 80005, 0, 9, 0, 0, 106401, "シェフィ", "それから、それから…！\nぅ、ぅぅっ…！", 27, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (439, 80005, 0, 9, 0, 0, 106401, "シェフィ", "―びえぇぇ～んっ！！！", 28, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (440, 80005, 1, 9, 0, 0, 105901, "コッコロ", "どうされましたか、シェフィさま", 20, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (441, 80005, 0, 9, 0, 0, 106401, "シェフィ", "ううっ…ひっく…\nママッ…！", 29, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (442, 80005, 1, 9, 0, 0, 105901, "コッコロ", "よしよし、緊張されてるのですね\nママが傍におりますよ\n主さま、少々お待ちくださいませ", 21, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (443, 80005, 1, 9, 0, 0, 105901, "コッコロ", "…ふぅ\nシェフィさま\n生放送への意気込み\nお話しできそうですか？", 22, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (444, 80005, 0, 9, 0, 0, 106401, "シェフィ", "…ううっ\n恥ずかしすぎて\nもう生放送出られない…", 30, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (445, 80005, 0, 10, 0, 0, 105901, "コッコロ", "主さま\n3.5周年まであと５日\nでございます", 23, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (446, 80005, 0, 10, 0, 0, 105901, "コッコロ", "ですがその前に\n生放送がありますね", 24, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (447, 80005, 0, 10, 0, 0, 105901, "コッコロ", "…生放送に向けた\n意気込みでございますか？", 25, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (448, 80005, 0, 10, 0, 0, 105901, "コッコロ", "もちろんわたくしは\n主さまのために\n全身全霊を込めて\n楽しい時間をご提供いたします", 26, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (449, 80005, 0, 10, 0, 0, 105901, "コッコロ", "…と、意気込んでみましたが\nうまくできるか少し不安です\n声が小さくなったり\n間違えてしまったらどうしようと…", 27, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (450, 80005, 0, 10, 0, 0, 105901, "コッコロ", "ですがわたくしは\n一人ではありません\n【美食殿】のみなさまが\nおります", 28, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (451, 80005, 0, 10, 0, 0, 105901, "コッコロ", "どんな困難も\nみなさまと一緒なら\n乗り越えられると\nわたくし、確信しております", 29, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (452, 80005, 0, 10, 0, 0, 105901, "コッコロ", "それに今回はシェフィさまも\nご参加されるわけですし\nママとしてお手本に\nならねばなりませんね", 30, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (453, 80005, 0, 10, 0, 0, 105901, "コッコロ", "主さま。3.5周年も\n食卓を囲んでいる時のような\n楽しい思い出を\n一緒に作りましょうね", 31, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (454, 80005, 0, 11, 0, 0, 105801, "ペコリーヌ", "3.5周年まであと４日！\nやばいですね☆", 26, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (455, 80005, 1, 11, 0, 0, 106001, "キャル", "はいはい、やばいわね\nというかもうすぐ生放送だけど\nあんた準備はできてるの？", 32, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (456, 80005, 0, 11, 0, 0, 105801, "ペコリーヌ", "ばっちりオイッスー☆　ですよ！\n『王家の装備』も全開です！", 27, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (457, 80005, 0, 11, 0, 0, 105801, "ペコリーヌ", "あとは前回を超える\n最高のオイッスー☆　を\nお届けできるように\n練習あるのみですかね！", 28, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (458, 80005, 0, 11, 0, 0, 105801, "ペコリーヌ", "キャルちゃんは\nどうなんですか？\nオイッスー☆　を\n毎日ちゃんと練習してますか？", 29, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (459, 80005, 1, 11, 0, 0, 106001, "キャル", "はぁ！？　なんであたしまで\nその変なあいさつを練習しないと\nいけないのよ！", 33, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (460, 80005, 0, 11, 0, 0, 105801, "ペコリーヌ", "もしかしてやってないんですか？\nダメですよキャルちゃん！\nシェフィちゃんだってちゃんと\n毎日練習してるのに！", 30, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (461, 80005, 0, 11, 0, 0, 105801, "ペコリーヌ", "こうなったらわたしがキャルちゃん\nにオイッスー☆　の『オ』から\nしっかり教えてあげないと！", 31, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (462, 80005, 0, 11, 0, 0, 105801, "ペコリーヌ", "オイッスー☆　の『オ』は\n口を大きく開いて〜\nドラゴンの骨つき肉に\nかぶりつく直前をイメージして〜", 32, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (463, 80005, 1, 11, 0, 0, 106001, "キャル", "だからあたしはやるなんて一言も…", 34, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (464, 80005, 0, 11, 0, 0, 105801, "ペコリーヌ", "オイッスー☆", 33, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (465, 80005, 1, 11, 0, 0, 106001, "キャル", "聞きなさいっての！！", 35, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (466, 80005, 2, 12, 0, 0, 106401, "シェフィ", "3.5周年まであと３日…\nそして生放送は、明日…", 31, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (467, 80005, 2, 12, 0, 0, 106401, "シェフィ", "もっと台本を\n読み込んでおかないと…\nあと発声練習も…", 32, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (468, 80005, 2, 12, 0, 0, 106401, "シェフィ", "おいっす！\n…こうじゃなかったわね\nええと確か…", 33, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (469, 80005, 2, 12, 0, 0, 106401, "シェフィ", "うう…あんなに練習したのに\nこれじゃみんなに迷惑かけちゃう…", 34, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (470, 80005, 2, 12, 0, 0, 106401, "シェフィ", "【美食殿】の一員として\n認められるように\n頑張らないといけないのに\nよし、もう一度…", 35, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (471, 80005, 3, 12, 0, 0, 105801, "ペコリーヌ", "やってますねシェフィちゃん！", 34, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (472, 80005, 0, 12, 0, 0, 106001, "キャル", "なによ、考えることは\nみんな同じってこと？", 36, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (473, 80005, 1, 12, 0, 0, 105901, "コッコロ", "ふふ。シェフィさま\nよろしければ\n仲間に入れてください\n一緒にやればきっとうまくできます", 32, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (474, 80005, 2, 12, 0, 0, 106401, "シェフィ", "みんな…もちろんよ！", 36, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (475, 80005, 3, 12, 0, 0, 105801, "ペコリーヌ", "それじゃ明日の生放送に向けて\n一緒に練習がんばりましょう☆", 35, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (476, 80005, 2, 13, 0, 0, 190801, "カリン", "3.5周年まであと２日と\n迫った本日は…\nいよいよ生放送です！", 7, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (477, 80005, 2, 13, 0, 0, 190801, "カリン", "【美食殿】のみなさんが\n準備に入られていますので\nそれぞれ繋いでみましょう！\nまずはペコリーヌさんです！", 8, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (478, 80005, 3, 13, 0, 0, 105801, "ペコリーヌ", "今日もオイッスー☆\nみんなで一緒に\nオイッスー☆", 36, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (479, 80005, 2, 13, 0, 0, 190801, "カリン", "お手本になるような\n発声練習ですね！\nそれでは続いてコッコロさん", 9, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (480, 80005, 4, 13, 0, 0, 105901, "コッコロ", "はじめちょろちょろ\nなかぱっぱ～♪\n生放送前にみなさまで\n食卓を囲んで英気を養いましょう", 33, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (481, 80005, 2, 13, 0, 0, 190801, "カリン", "さすが【美食殿】のママですね！\nそしてキャルさんは…", 10, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (482, 80005, 1, 13, 0, 0, 106001, "キャル", "大丈夫…大丈夫…\nあたしは大丈夫…", 37, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (483, 80005, 2, 13, 0, 0, 190801, "カリン", "す、すごく震えてますけど\n大丈夫でしょうか…？\nそして今回初参加となる\n期待の新人シェフィさん！", 11, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (484, 80005, 0, 13, 0, 0, 106401, "シェフィ", "あうー？", 37, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (485, 80005, 4, 13, 0, 0, 105801, "みんな", "あ…", 37, 1, "105901,34,106001,38,190801,12");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (486, 80005, 1, 13, 0, 0, 106001, "キャル", "ちょ、ちょっとシェフィ！？\nなに赤ちゃん返りしてん―\nあ痛ぁっ！\n噛んだわこいつーっ！", 39, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (487, 80005, 4, 13, 0, 0, 105901, "コッコロ", "シェフィさま\n緊張しすぎて\nしまったのでしょうね…\nおーよしよし…", 35, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (488, 80005, 3, 13, 0, 0, 105801, "ペコリーヌ", "シェフィちゃん！\nそういう時は手のひらに\n好きな文字を書いて\n食べちゃうといいですよ！", 38, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (489, 80005, 2, 13, 0, 0, 190801, "カリン", "…ええと、現場からは以上です！\n生放送はもうすぐ！\n特別なお知らせもありますので\nどうぞお楽しみに！", 13, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (490, 80005, 2, 14, 0, 0, 106401, "シェフィ", "3.5周年の記念日も\nいよいよ明日ね\n…って、あれ？", 38, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (491, 80005, 3, 14, 0, 0, 105801, "ペコリーヌ", "記念日はこの森へ行きませんか！？\nすっごく美味しいお肉が\nとれるんです☆", 39, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (492, 80005, 0, 14, 0, 0, 106001, "キャル", "うげ、またあの魔物？\nさすがに今度は\n丸焼きとかはやめてよね…\n見た目がヤバすぎるし", 40, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (493, 80005, 1, 14, 0, 0, 105901, "コッコロ", "ふふ、キャルさまもだいぶ\n魔物肉に慣れてきたようですね\n調理ならばわたくしに\nお任せください♪", 36, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (494, 80005, 2, 14, 0, 0, 106401, "シェフィ", "みんな、何をしているの？\nなんだか、\n不穏な単語が聞こえたんだけど…", 39, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (495, 80005, 3, 14, 0, 0, 105801, "ペコリーヌ", "シェフィちゃん！\n明日の食べ尽くしツアーの\n相談をしてたんですよ！", 40, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (496, 80005, 1, 14, 0, 0, 105901, "コッコロ", "はい。明日は【美食殿】の\n一員となったシェフィさまと一緒に\n初めて記念日を過ごすのですから\n特別なコース料理を用意しませんと", 37, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (497, 80005, 0, 14, 0, 0, 106001, "キャル", "ふふん♪\n猫の毛も逆立つような\nあれこれを食べさせられるから\n覚悟しておいたほうがいいわよ？", 41, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (498, 80005, 2, 14, 0, 0, 106401, "シェフィ", "へ、へぇ…", 40, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (499, 80005, 3, 14, 0, 0, 105801, "ペコリーヌ", "期待しててくださいね！\nシェフィちゃんとあなたに\n『おいちー！』って喜んでもらえる\n最高のごちそうを準備しますから☆", 41, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (500, 80005, 2, 14, 0, 0, 106401, "シェフィ", "ええと…その…うーんと…\nわ、分かったわ\n私も【美食殿】の一員だもの", 41, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (501, 80005, 2, 14, 0, 0, 106401, "シェフィ", "それにあなたも一緒みたいだし\n最後までがんばってみるわ…！", 42, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (502, 80005, 3, 15, 0, 0, 105801, "ペコリーヌ", "それではいつものあれを\nやりましょう！\n準備はいいですかっ？\n…いっきますよー！", 42, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (503, 80005, 1, 15, 0, 0, 106001, "キャル", "祝！", 42, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (504, 80005, 4, 15, 0, 0, 105901, "コッコロ", "3.5周年！", 38, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (505, 80005, 0, 15, 0, 0, 106401, "シェフィ", "おめでとうございます！", 43, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (506, 80005, 2, 15, 0, 0, 190801, "カリン", "この日を迎えられたのも\nあなたが『プリンセスコネクト！\nRe:Dive』を遊んでくれている\nおかげです！", 14, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (507, 80005, 2, 15, 0, 0, 190801, "カリン", "ということで\nみなさんからあなたへ一言ずつ\n感謝の言葉をどうぞ！", 15, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (508, 80005, 3, 15, 0, 0, 105801, "ペコリーヌ", "感謝の言葉ですか？　わたしは\n毎日あなたに感謝してますよ\n【美食殿】の仲間になってくれて…\n一緒にごはんを食べてくれて…", 43, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (509, 80005, 3, 15, 0, 0, 105801, "ペコリーヌ", "なにより今でもわたしをぺコリーヌ\nって呼んでくれてありがとうござい\nます。これからもわたしはあなたの\nぺコリーヌです！　やばいですね☆", 44, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (510, 80005, 1, 15, 0, 0, 106001, "キャル", "えっ！？　今度はあたし！？\n感謝って…まぁ、そうね…\nあんたにはあたしが\n辛くて苦しい時に助けてもらって…", 43, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (511, 80005, 1, 15, 0, 0, 106001, "キャル", "でもおかげで色々吹っ切れたわ！\nもしあんたが困ってたら今度は\nあたしが助けてあげるから\nその時はちゃんと言いなさいよ！", 44, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (512, 80005, 0, 15, 0, 0, 106401, "シェフィ", "ええと…次は私ね\n実はよく覚えてないのだけど\n空から落ちてきた私を受け止めて\nくれたのはあなたなのでしょう？", 44, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (513, 80005, 0, 15, 0, 0, 106401, "シェフィ", "最初に私を見つけてくれたのが\nあなたで良かったって思ってるの\nおかげで私は居場所を見つけたから\nあなたがくれたもの、大切にするわ", 45, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (514, 80005, 4, 15, 0, 0, 105901, "コッコロ", "では最後にわたくしから…\nわたくしは主さまの元を離れた日…\nこのように記念日をお祝いする\nことは二度とないと思っていました", 39, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (515, 80005, 4, 15, 0, 0, 105901, "コッコロ", "ですが、主さまはわたくしを\n迎えにきてくださり、今もこうして\nおそばにおいてくださっています\nわたくしにとって毎日が記念日です", 40, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (516, 80005, 4, 15, 0, 0, 105901, "コッコロ", "わたくしたちの物語は\nまだ続いていきます\nこれからも一緒にページを\n作っていきましょうね", 41, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (517, 80005, 3, 15, 0, 0, 105801, "ペコリーヌ", "それじゃ\nいつものあれでしめますよ！\nみんなで一緒に、さんはい☆", 45, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (518, 80005, 4, 15, 0, 0, 105801, "みんな", "これからも\nよろしくおねがいします！", 46, 1, "105901,42,106001,45,106401,46,190801,16");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (519, 60003, 1, 0, 0, 1, 190804, "カリン", "新年を迎え、新たに始まる一日を\nおみくじで占ってみませんか？\n良い運勢であるほど、\n沢山のプレゼントが貰えますよ♪", 1, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (520, 60003, 2, 0, 1, 1, 0, "", "今日の運勢は姫吉！　どんな不可能も可能にできちゃう！　　　　仲間と食卓を囲めばさらに運気上昇よ！　ただし魔物料理以外！", 0, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (521, 60003, 2, 0, 1, 1, 0, "", "今日の運勢は姫吉！　やること全てが最高潮！　やばいですね☆　ラッキーアイテムはおにぎり！　お腹一杯で幸せが続くでしょう！", 0, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (522, 60003, 2, 0, 1, 1, 0, "", "今日の運勢は姫吉！　羽が生えたように飛躍できる絶好調の運気！新しいことに挑戦するなら今しかないわ！　やってみましょう！", 0, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (523, 60003, 2, 0, 1, 1, 0, "", "今日の運勢は姫吉！　精霊も新年の幸福をお祝いしています！　　主さまの笑顔が見られて、わたくしも幸せいっぱいでございます♪", 0, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (524, 60003, 2, 0, 1, 2, 0, "", "今日の運勢は姫吉！　やること全てが上手くいく最高の一日！　　あなたの活躍に先生もにっこりです。いい子いい子♪", 0, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (525, 60003, 2, 0, 2, 1, 0, "", "今日の運勢は大吉！　お裁縫好きな女の子のお墨付きです！　　　お世話したがりの妹にめいっぱい愛されちゃうかも！？", 0, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (526, 60003, 2, 0, 2, 1, 0, "", "今日の運勢は大吉！　ラッキーカラーは赤！　　　　　　　　　　湧き上がるアイデアの数々に、高笑いが止まりませんわ！", 0, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (527, 60003, 2, 0, 2, 1, 0, "", "今日の運勢は大吉！　ラッキーカラーは鮮やかな黄色！　　　　　さらにシマシマのアイテムを持つと、運気倍増らしいッスよ♪", 0, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (528, 60003, 2, 0, 2, 1, 0, "", "今日の運勢は大吉！　秘められた力が開花するでしょう！　　　　じゃあ、私の龍眼と力比べしてみようか？　ふふ、冗談だよ～", 0, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (529, 60003, 2, 0, 2, 2, 0, "", "今日の運勢は大吉！　悩んでいたことが解決しそうです！　　　　たまには勉強も仕事も忘れて、心あたたまる家族と過ごしましょ！", 0, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (530, 60003, 2, 0, 3, 1, 0, "", "今日の運勢は中吉！　家の中でゆっくり過ごすのがよさそう！　　ラッキーアイテムはゲームよ！　ベストスコアを更新できるかも？", 0, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (531, 60003, 2, 0, 3, 1, 0, "", "今日の運勢は中吉！　上手くなりたいことに積極的に挑戦してみてサックス好きの妹が、手取り足取りサポートしてくれるかも～？", 0, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (532, 60003, 2, 0, 3, 1, 0, "", "今日の運勢は中吉！　仕事運が急上昇中です！　　　　　　　　　きっと「煉獄に舞う一陣の疾風」の如き活躍ができますよ！", 0, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (533, 60003, 2, 0, 3, 1, 0, "", "今日の運勢は中吉！　日頃の努力が報われます！　　　　　　　　親しい友人がいるなら報告してみて。一緒に喜んでくれるはずだ。", 0, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (534, 60003, 2, 0, 3, 1, 0, "", "今日の運勢は中吉！　ラッキーアイテムはかわいいもの！　　　　ア、アタシはかわいいじゃなくてキレイだってば！　も～っ！", 0, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (535, 60003, 2, 0, 3, 1, 0, "", "今日の運勢は中吉！　チャンスを待つと良い結果に！　　　　　　ラッキーアイテムのプリンを食べて、運を呼び込みましょう！", 0, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (536, 60003, 2, 0, 3, 2, 0, "", "今日の運勢は中吉！　悩まず行動すれば強運に恵まれる！　　　　守るよりも攻めるが吉だ！　勝負事をするにはいい運勢だな！", 0, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (537, 60003, 2, 0, 4, 1, 0, "", "今日の運勢は小吉！　まだ見ぬ危険が隠れているかも！　　　　　でも安心しろ！　提督が貴公を守ってくれるはずだぞ！", 0, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (538, 60003, 2, 0, 4, 1, 0, "", "今日の運勢は小吉！　いろんな事件が起こる一日になりそう！　　状況をよく観察してみようじゃないか！　まさに探偵のごとくね！", 0, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (539, 60003, 2, 0, 4, 1, 0, "", "今日の運勢は小吉！　気の向くままに過ごすのが幸せへの近道！　美味い魚を食べて猫を眺めて、自然体で過ごすのはどうだい？", 0, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (540, 60003, 2, 0, 4, 1, 0, "", "今日の運勢は小吉！　難しい頼み事をされるかもしれません！　　うまくやれればきっと成長につながります、挑戦してみましょう！", 0, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (541, 60003, 2, 0, 4, 1, 0, "", "今日の運勢は小吉！　同腹一心の友だちが見つかるかも！　　　　キーワードは「ユニちゃんズ」、記憶に刻みましょう！", 0, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (542, 60003, 2, 0, 4, 1, 0, "", "今日の運勢は小吉！　周りに流されず、マイペースな一日を！　　ただし寝すぎには注意ぐうたらし過ぎず適度な運動を、だってさ～", 0, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (543, 60003, 2, 0, 4, 2, 0, "", "今日の運勢は小吉！　無理は禁物、お家で静かにしていましょう　プロぼっちの私が、お家での過ごし方……教えてあげましょうか？", 0, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (544, 60003, 3, 0, 0, 0, 190804, "カリン", "おみくじの結果はどうでしたか？\n新たに始まる一日が、あなたに\nとって良い日になりますように\nまた明日も遊びに来て下さいね♪", 2, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (545, 60003, 3, 7, 0, 0, 190804, "カリン", "おみくじは楽しんで頂けましたか？\nあなたの新たなる年が\n素晴らしいものになるよう、\n心からお祈りいたします", 3, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (546, 60004, 1, 0, 0, 1, 190804, "カリン", "新年を迎え、新たに始まる一日を\nおみくじで占ってみませんか？\n良い運勢であるほど、\n沢山のプレゼントが貰えますよ♪", 1, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (547, 60004, 2, 0, 1, 1, 0, "", "今日の運勢は姫吉！　やること全てが最高潮！　やばいですね☆　ラッキーアイテムはおにぎり！　お腹一杯で幸せが続くでしょう！", 0, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (548, 60004, 2, 0, 1, 1, 0, "", "今日の運勢は姫吉！　羽が生えたように飛躍できる絶好調の運気！新しいことに挑戦するなら今しかないわ！　やってみましょう！", 0, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (549, 60004, 2, 0, 1, 1, 0, "", "今日の運勢は姫吉！　宴でも開きたくなるほどの絶対幸運！\nイメチェンでもしてみるのはどうだ？　ぴょんぴょん、なんてな♪", 0, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (550, 60004, 2, 0, 1, 1, 0, "", "今日の運勢は姫吉！　ずっと祈り続けていた願いが叶うかも！\nきっとあんたならたどり着けるわ、ハッピーエンドのその先に", 0, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (551, 60004, 2, 0, 1, 1, 0, "", "今日の運勢は姫吉！　やること全てが上手くいく最高の一日！　　あなたの活躍に先生もにっこりです。いい子いい子♪", 0, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (552, 60004, 2, 0, 2, 1, 0, "", "今日の運勢は大吉！　悩んでいたことが解決しそうです！　　　　たまには勉強も仕事も忘れて、心あたたまる家族と過ごしましょ！", 0, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (553, 60004, 2, 0, 2, 2, 0, "", "今日の運勢は大吉！　ラッキーカラーは赤！　　　　　　　　　　湧き上がるアイデアの数々に、高笑いが止まりませんわ！", 0, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (554, 60004, 2, 0, 2, 1, 0, "", "今日の運勢は大吉！　ラッキーワードは「ぴょんぴょん♪」\nおっきな声で一緒に言ってみよ～♪　うさぎさんぴょんぴょ～ん♪", 0, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (555, 60004, 2, 0, 2, 1, 0, "", "今日の運勢は大吉！　あなたの趣味がもっと広がるかも！\nかんわゆ～～～いショタと～騎士きゅんもゲット～んふふ～♪", 0, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (556, 60004, 2, 0, 2, 1, 0, "", "今日の運勢は大吉！　秘められた力が開花するでしょう！　　　　じゃあ、私の龍眼と力比べしてみようか？　ふふ、冗談だよ～", 0, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (557, 60004, 2, 0, 3, 1, 0, "", "今日の運勢は中吉！　ラッキーアイテムはかわいいもの！　　　　ア、アタシはかわいいじゃなくてキレイだってば！　も～っ！", 0, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (558, 60004, 2, 0, 3, 2, 0, "", "今日の運勢は中吉！　悩まず行動すれば強運に恵まれる！　　　　守るよりも攻めるが吉だ！　勝負事をするにはいい運勢だな！", 0, 0, "");
