INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (560, 60004, 2, 0, 3, 1, 0, "", "今日の運勢は中吉！　大抵のことはゴリ押しでなんとかできます！ラッキープレイスはゲーセン。パンチングマシンでストレス発散！", 0, 0, "");
INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (561, 60004, 2, 0, 3, 1, 0, "", "今日の運勢は中吉！　健康に気を遣って気持ちのいい一年を！\n体に不調があるときは遠慮なく言いなさい、隅々まで調べてあげる", 0, 0, "");
