INSERT INTO `v1_d0b81125471d45661bc955cd935bf3ced395cb9c350626bcde9fa1c280fed1e0` VALUES (599, 60005, 3, 7, 0, 0, 190804, "カリン", "おみくじは楽しんで頂けましたか？\nあなたの新たなる年が\n素晴らしいものになるよう、\n心からお祈りいたします", 3, 0, "");
